DROP TABLE IF EXISTS `a_vendor`;
CREATE TABLE `a_vendor` (
  `id` int(11) NOT NULL,
  `kode` varchar(8) NOT NULL DEFAULT '00',
  `pic_nama` varchar(255) NOT NULL,
  `pic_telp` varchar(32) NOT NULL,
  `pic_email` varchar(255) NOT NULL,
  `pic_hub` varchar(255) NOT NULL,
  `nama` varchar(255) NOT NULL,
  `telp` varchar(32) NOT NULL,
  `alamat` varchar(255) NOT NULL,
  `badan_usaha` varchar(255) NOT NULL,
