DROP TABLE IF EXISTS `b_user`;
CREATE TABLE `b_user` (
  `id` int(11) NOT NULL,
  `a_company_id` int(11) DEFAULT NULL,
  `kode` varchar(24) NOT NULL,
  `email` varchar(255) NOT NULL,
  `password` varchar(255) DEFAULT NULL,
  `fnama` varchar(255) NOT NULL,
  `lnama` varchar(255) NOT NULL,
  `alamat` text NOT NULL,
  `kelurahan` varchar(255) NOT NULL,
  `kecamatan` varchar(255) NOT NULL,
  `kabkota` varchar(255) NOT NULL,
  `provinsi` varchar(255) NOT NULL DEFAULT '',
  `negara` varchar(255) NOT NULL DEFAULT 'Indonesia',
  `kodepos` varchar(25) NOT NULL,
  `kelamin` int(1) NOT NULL DEFAULT '1' COMMENT '1 laki-laki 0 perempuan',
  `bdate` date NOT NULL DEFAULT '1970-01-01' COMMENT 'tanggal lahir',
  `cdate` datetime NOT NULL COMMENT 'tanggal pembuatan',
  `adate` date DEFAULT NULL COMMENT 'tanggal aktifasi',
  `edate` date DEFAULT NULL COMMENT 'tanggal berakhir membership',
  `telp` varchar(25) NOT NULL,
  `fb` varchar(255) NOT NULL,
  `fb_id` int(11) DEFAULT NULL,
  `ig` varchar(255) NOT NULL,
  `ig_id` int(11) DEFAULT NULL,
  `deposit` float NOT NULL DEFAULT '0' COMMENT 'saldo_deposit',
  `poin` int(11) NOT NULL DEFAULT '0',
  `image` varchar(255) NOT NULL,
  `reg_from` varchar(64) NOT NULL DEFAULT 'online',
  `ptype` varchar(78) NOT NULL DEFAULT 'umum' COMMENT 'jenis pelanggan',
  `umur` int(3) NOT NULL DEFAULT '20',
  `pekerjaan` varchar(78) NOT NULL DEFAULT '-',
  `beli_jml` int(6) NOT NULL DEFAULT '0',
  `beli_terakhir` datetime DEFAULT NULL,
  `beli_total` float NOT NULL DEFAULT '0',
  `api_web_token` varchar(24) DEFAULT NULL,
  `api_mobile_token` varchar(24) DEFAULT NULL,
  `fcm_token` varchar(255) NOT NULL,
  `is_subscriber` int(1) NOT NULL DEFAULT '0',
  `is_agree` int(1) NOT NULL DEFAULT '0',
  `is_confirmed` int(1) NOT NULL DEFAULT '0' COMMENT '1 ya, 0 belum konfirmasi, flag setelah konfirmasi',
  `is_premium` int(1) NOT NULL DEFAULT '0',
  `is_active` int(1) NOT NULL DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='tabel pengguna, bisa member atau user vendor,';


DROP TABLE IF EXISTS `b_user_alamat`;
CREATE TABLE `b_user_alamat` (
  `id` int(11) NOT NULL,
  `b_user_id` int(11) NOT NULL,
  `nama_alamat` varchar(50) NOT NULL,
  `nama_penerima` varchar(255) NOT NULL,
  `telp` varchar(25) NOT NULL,
  `alamat` varchar(255) NOT NULL,
  `kelurahan` varchar(255) NOT NULL,
  `kecamatan` varchar(255) NOT NULL,
  `kabkota` varchar(255) NOT NULL,
  `provinsi` varchar(255) NOT NULL,
  `negara` varchar(255) NOT NULL,
  `kodepos` varchar(10) NOT NULL,
  `is_default` int(1) NOT NULL DEFAULT '1',
  `is_active` int(1) NOT NULL DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='buku alamat untuk user';

DROP TABLE IF EXISTS `b_user_store`;
CREATE TABLE `b_user_store` (
  `id` int(11) NOT NULL,
  `b_user_id` int(11) NOT NULL,
  `nama` varchar(255) NOT NULL,
  `telp` varchar(32) NOT NULL,
  `logo` varchar(255) NOT NULL,
  `website` varchar(255) NOT NULL,
  `is_active` int(1) NOT NULL DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `b_user_vendor`;
CREATE TABLE `b_user_vendor` (
  `id` int(11) NOT NULL,
  `b_user_id` int(11) NOT NULL,
  `a_vendor_id` int(11) NOT NULL,
  `is_admin` int(1) NOT NULL DEFAULT '0',
  `is_active` int(1) NOT NULL DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='jadi vendor itu bisa dikelola oleh user kita';

DROP TABLE IF EXISTS `b_vendor_brand`;
CREATE TABLE `b_vendor_brand` (
  `id` int(11) NOT NULL,
  `a_vendor_id` int(11) NOT NULL,
  `b_kategori_id` int(11) NOT NULL COMMENT 'mengacu kepada Kategori tag id yang jenis nya brand',
  `kode` varchar(16) DEFAULT '00',
  `brand` varchar(128) NOT NULL DEFAULT '-'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='tabel khusus vendor yang mengelola brand, jadi bisa vendor';


DROP TABLE IF EXISTS `c_bank`;
CREATE TABLE `c_bank` (
  `id` int(11) NOT NULL,
  `b_bukubesar_id` int(11) DEFAULT NULL,
  `a_company_id` int(11) DEFAULT NULL,
  `b_user_id` int(11) DEFAULT NULL,
  `bank_nama` varchar(255) NOT NULL,
  `cabang_nama` varchar(255) NOT NULL,
  `rekening_nama` varchar(255) NOT NULL,
  `rekening_nomor` varchar(128) NOT NULL,
  `is_active` int(1) NOT NULL DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `c_barang_inventory`;
CREATE TABLE `c_barang_inventory` (
  `id` int(11) NOT NULL,
  `a_toko_id` int(11) NOT NULL,
  `b_barang_id` int(11) NOT NULL,
  `a_pengguna_id` int(11) NOT NULL,
  `b_barang_toko_kode` varchar(32) NOT NULL,
  `harga_dasar` float NOT NULL COMMENT 'dari tabel barang',
  `harga_beli` float NOT NULL COMMENT 'harga_bli dari pembelian',
  `sub_total_beli` float NOT NULL DEFAULT '0' COMMENT 'sub total dari satuan harga dasar',
  `diskon_beli` float NOT NULL DEFAULT '0' COMMENT 'isi kalau ada diskon',
  `total_beli` float NOT NULL DEFAULT '0' COMMENT 'total harga setelah diskon',
  `qty_beli` decimal(6,2) NOT NULL,
  `satuan_beli` varchar(78) NOT NULL DEFAULT 'Pcs',
  `qty` decimal(6,2) NOT NULL COMMENT 'setelah dikonversi',
  `satuan` varchar(78) NOT NULL DEFAULT 'Pcs' COMMENT 'setelah dikonversi',
  `qty_last` decimal(6,2) NOT NULL COMMENT 'qty sebelumnya',
  `satuan_last` varchar(78) NOT NULL DEFAULT 'Pcs',
  `total_last` float NOT NULL COMMENT 'total harga sebelumnya',
  `total` float NOT NULL COMMENT 'total harga',
  `jenis` varchar(3) NOT NULL DEFAULT 'in' COMMENT 'in atau out',
  `jenis_kategori` varchar(100) NOT NULL,
  `keterangan` varchar(255) NOT NULL,
  `c_barang_inventory_id` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='buat mutasi inventory produk';

DROP TABLE IF EXISTS `c_booking`;
CREATE TABLE `c_booking` (
  `id` int(11) NOT NULL,
  `a_company_id` int(11) DEFAULT NULL COMMENT 'id cabang',
  `b_user_id` int(11) DEFAULT NULL COMMENT 'id pelanggan',
  `kode` varchar(24) NOT NULL,
  `cdate` datetime NOT NULL,
  `bdate` datetime NOT NULL,
  `edate` datetime DEFAULT NULL,
  `ustatus` enum('booked','cancelled','used') NOT NULL DEFAULT 'booked'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='tabel booking cabang';


DROP TABLE IF EXISTS `c_carabayar`;
CREATE TABLE `c_carabayar` (
  `id` int(11) NOT NULL,
  `c_bank_id` int(11) DEFAULT NULL,
  `utype` enum('online','offline') NOT NULL DEFAULT 'offline',
  `kode` varchar(64) NOT NULL,
  `nama` varchar(255) NOT NULL,
  `deskripsi` text NOT NULL,
  `priority` int(2) NOT NULL DEFAULT '0',
  `is_active` int(1) NOT NULL DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='tabel list cara bayar';


DROP TABLE IF EXISTS `c_flashsale`;
CREATE TABLE `c_flashsale` (
  `id` int(11) NOT NULL,
  `nama` varchar(255) NOT NULL,
  `image` varchar(255) NOT NULL,
  `sdate` datetime NOT NULL,
  `edate` datetime NOT NULL,
  `isi` text NOT NULL,
  `is_active` int(1) NOT NULL DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `c_flashsale_isi`;
CREATE TABLE `c_flashsale_isi` (
  `id` int(11) NOT NULL,
  `c_flashsale_id` int(11) DEFAULT NULL,
  `prioritas` int(3) NOT NULL DEFAULT '0',
  `utype` enum('tag','produk','kategori') NOT NULL DEFAULT 'produk',
  `id_target_utype` int(11) DEFAULT NULL,
  `slug_target_utype` varchar(255) NOT NULL DEFAULT '',
  `nama_target_utype` varchar(255) NOT NULL,
  `promo_jenis` enum('harga','persen') NOT NULL DEFAULT 'harga',
  `promo_nilai` float NOT NULL,
  `harga_asal` float NOT NULL,
  `harga_jadi` float NOT NULL,
  `qty_limit` int(3) NOT NULL DEFAULT '0',
  `qty_sisa` int(3) NOT NULL DEFAULT '0',
  `is_habis` int(1) NOT NULL DEFAULT '0',
  `is_active` int(1) NOT NULL DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `c_flashsale_produk`;
CREATE TABLE `c_flashsale_produk` (
  `id` int(11) NOT NULL,
  `c_flashsale_id` int(11) DEFAULT NULL,
  `c_produk_id` int(11) DEFAULT NULL,
  `promo_jenis` enum('persen','harga') NOT NULL DEFAULT 'harga',
  `promo_nilai` float NOT NULL,
  `harga_asal` float NOT NULL,
  `harga_jadi` float NOT NULL,
  `qty_sisa` int(11) NOT NULL,
  `qty_limit` int(11) NOT NULL,
  `ldate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `c_jurnal`;
CREATE TABLE `c_jurnal` (
  `id` int(11) NOT NULL,
  `b_bukubesar_id` int(11) DEFAULT NULL,
  `d_transaksi_id` int(11) DEFAULT NULL,
  `jenis` enum('item','subitem') NOT NULL DEFAULT 'item',
  `debit` float DEFAULT NULL,
  `kredit` float DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='tabel jurnal';

DROP TABLE IF EXISTS `c_pembelian`;
CREATE TABLE `c_pembelian` (
  `id` int(11) NOT NULL,
  `b_karyawan_id` int(11) NOT NULL COMMENT 'karyawan yang melakukan pembelian',
  `a_pekerjaan_id` int(11) NOT NULL,
  `a_toko_id` int(11) NOT NULL,
  `kendaraan` int(11) DEFAULT NULL COMMENT 'mengambil dari b_barang_id jenis kendaraan RD/RE. Jika null jalan kaki',
  `jenis_bbm` int(11) DEFAULT NULL COMMENT 'mengambil dari b_barang_id jenis kendaraan B0-B9. Jika null jalan kaki',
  `qty_lokasi` int(3) NOT NULL DEFAULT '1',
  `qty_jarak` decimal(6,2) NOT NULL DEFAULT '1.00',
  `satuan_jarak` varchar(78) NOT NULL DEFAULT 'KM',
  `upah_dasar` float NOT NULL,
  `upah_satuan` varchar(78) NOT NULL,
  `keterangan` varchar(255) NOT NULL,
  `date_create` datetime DEFAULT NULL,
  `date_mulai` datetime DEFAULT NULL,
  `date_selesai` datetime DEFAULT NULL,
  `date_terima` datetime DEFAULT NULL,
  `biaya_parkir` float NOT NULL,
  `qty_bbm` decimal(6,2) NOT NULL,
  `satuan_bbm` varchar(78) NOT NULL DEFAULT 'L',
  `biaya_bbm` float NOT NULL,
  `total_pembelian` float NOT NULL COMMENT 'jumlah dari masing2 harga pembelian barang',
  `total` float NOT NULL DEFAULT '0' COMMENT 'total biaya pembelian barang + variabel lainya'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='tabel purchasing';

DROP TABLE IF EXISTS `c_pembelian_material`;
CREATE TABLE `c_pembelian_material` (
  `id` int(11) NOT NULL,
  `c_pembelian_id` int(11) NOT NULL,
  `b_barang_id` int(11) NOT NULL,
  `a_toko_id` int(11) NOT NULL,
  `b_karyawan_id` int(11) NOT NULL COMMENT 'Penerima Barang setelah dibeli',
  `harga_beli` float NOT NULL COMMENT 'diambil dari harga dasar di tabel b_barang',
  `qty_beli` decimal(6,2) NOT NULL DEFAULT '1.00',
  `sub_total_beli` float NOT NULL DEFAULT '0',
  `qty_terima` decimal(6,2) NOT NULL,
  `sub_total_terima` float NOT NULL DEFAULT '0',
  `diskon_terima` float NOT NULL DEFAULT '0',
  `total_terima` float NOT NULL DEFAULT '0',
  `date_ubah` datetime DEFAULT NULL,
  `date_terima` datetime DEFAULT NULL,
  `keterangan` varchar(255) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='list pembelian';

DROP TABLE IF EXISTS `c_produk`;
CREATE TABLE `c_produk` (
  `id` int(11) NOT NULL,
  `a_company_id` int(11) DEFAULT NULL,
  `a_pengguna_id` int(11) DEFAULT NULL,
  `b_kategori_id` int(11) DEFAULT NULL COMMENT 'untuk brand, mengacu pada b_kategori_tag',
  `a_vendor_id` int(11) DEFAULT NULL,
  `utype` enum('utama','variasi','paket','projek') NOT NULL DEFAULT 'utama' COMMENT 'variasi produk adalah produk yang berbeda rasa, ukuran, warna, dll.',
  `jenis` enum('pakaian','aksesoris','katalog','membership','makanan','barang','jasa','tas','sepatu','kaos','jaket','topi') NOT NULL DEFAULT 'makanan',
  `sku` varchar(64) NOT NULL,
  `nama` varchar(255) NOT NULL,
  `slug` varchar(255) NOT NULL,
  `deskripsi_singkat` text NOT NULL,
  `deskripsi` text NOT NULL,
  `harga_beli` float NOT NULL,
  `harga_retail` float NOT NULL,
  `harga_jual` float NOT NULL,
  `diskon_harga` float NOT NULL DEFAULT '0' COMMENT 'jika ada maka akan dikurangi dari harga beli',
  `diskon_persen` int(3) NOT NULL DEFAULT '0' COMMENT 'Jika ada maka akan dikurangin dari harga jual',
  `diskon_expired` datetime DEFAULT NULL,
  `diskon_teks` varchar(255) NOT NULL DEFAULT '',
  `tahun` year(4) DEFAULT NULL COMMENT 'tahun produk, untuk filter',
  `ukuran` varchar(255) DEFAULT NULL,
  `warna` varchar(255) DEFAULT NULL,
  `rasa` varchar(255) DEFAULT NULL,
  `bahan` varchar(255) NOT NULL,
  `dimensi` varchar(255) NOT NULL DEFAULT '-',
  `berat` int(11) NOT NULL DEFAULT '1000' COMMENT 'dalam gram',
  `berat_packing` int(11) NOT NULL COMMENT 'dalam gram, berat yang di-up setelah parkir',
  `stok` int(11) NOT NULL COMMENT 'stok terakhir',
  `satuan` varchar(43) NOT NULL DEFAULT 'Pcs',
  `waiting_day` varchar(16) NOT NULL DEFAULT '3' COMMENT 'maksimum waiting day',
  `foto` text NOT NULL COMMENT 'url featured image produk',
  `thumb` text NOT NULL COMMENT 'url featured image produk thumbnail',
  `review` decimal(2,1) NOT NULL,
  `rating` decimal(2,1) NOT NULL,
  `dilihat` int(11) NOT NULL,
  `terjual` int(11) NOT NULL,
  `sales_rate` decimal(5,2) NOT NULL,
  `sales_count` int(11) NOT NULL,
  `best_dua_kata` varchar(255) NOT NULL,
  `pirt` varchar(50) NOT NULL DEFAULT '-',
  `bpom` varchar(50) NOT NULL DEFAULT '-',
  `halal` enum('vendor','mui','tidak','-') NOT NULL DEFAULT '-',
  `paket_jml` int(3) NOT NULL DEFAULT '0' COMMENT 'Jumlah x penggunaan paket',
  `mtitle` varchar(120) NOT NULL COMMENT 'meta title',
  `mkeyword` varchar(120) NOT NULL COMMENT 'meta keyword',
  `mdescription` varchar(160) NOT NULL COMMENT 'meta description',
  `tindakan_oleh` enum('dokter','perawat','terapis','semua') NOT NULL DEFAULT 'semua' COMMENT 'peralkuan tindakan jasa',
  `poin_terapis` decimal(5,2) NOT NULL DEFAULT '0.00',
  `poin_dokter` decimal(5,2) NOT NULL DEFAULT '0.00',
  `poin_pelanggan` decimal(5,2) NOT NULL DEFAULT '0.00',
  `scope` enum('all','current_below','current_only','none') NOT NULL DEFAULT 'none' COMMENT 'ruang lingkup produk',
  `moq_custom` int(5) NOT NULL DEFAULT '0',
  `tags` varchar(255) NOT NULL DEFAULT '',
  `is_asistensi` int(1) NOT NULL DEFAULT '0' COMMENT 'hanya untuk jasa',
  `is_customize` int(1) NOT NULL DEFAULT '0',
  `is_can_wait` int(1) NOT NULL DEFAULT '0',
  `is_komposisi` int(1) NOT NULL DEFAULT '0' COMMENT 'ada komposisi 1 ya, 0 tidak',
  `is_sold_out` int(1) NOT NULL DEFAULT '0',
  `is_sku_master` int(1) NOT NULL DEFAULT '1',
  `is_visible` int(1) NOT NULL DEFAULT '1',
  `is_active` int(1) NOT NULL DEFAULT '1',
  `c_produk_id` int(11) DEFAULT NULL COMMENT 'untuk relasi produk utama dan variasi'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='tabel produk';


DROP TABLE IF EXISTS `c_produksi`;
CREATE TABLE `c_produksi` (
  `id` int(11) NOT NULL,
  `b_rencana_id` int(11) NOT NULL,
  `b_barang_id` int(11) NOT NULL,
  `date_mulai` datetime NOT NULL,
  `date_selesai` datetime DEFAULT NULL,
  `kode` varchar(16) NOT NULL,
  `qty_target` decimal(6,2) NOT NULL DEFAULT '1.00',
  `satuan_target` varchar(78) NOT NULL DEFAULT 'Pcs',
  `qty_selesai` decimal(6,2) NOT NULL DEFAULT '1.00',
  `satuan_selesai` varchar(78) NOT NULL DEFAULT 'Pcs',
  `c_barang_id_selesai` int(11) DEFAULT NULL COMMENT 'mengambil dari b_barang_id',
  `c_barang_sku_selesai` varchar(32) DEFAULT NULL COMMENT 'mengambil dari b_barang_sku'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='tabel produksi';

DROP TABLE IF EXISTS `c_produksi_kegiatan`;
CREATE TABLE `c_produksi_kegiatan` (
  `id` int(11) NOT NULL,
  `c_produksi_id` int(11) NOT NULL,
  `b_rencana_id` int(11) NOT NULL,
  `b_rencana_material_id` int(11) NOT NULL,
  `a_jenis_id` int(11) NOT NULL,
  `b_barang_id` int(11) NOT NULL,
  `qty_target` decimal(6,2) NOT NULL,
  `satuan_target` varchar(78) NOT NULL DEFAULT 'Pcs',
  `qty_selesai` decimal(6,2) DEFAULT '1.00',
  `satuan_selesai` varchar(78) NOT NULL DEFAULT 'Pcs',
  `date_siap` datetime DEFAULT NULL,
  `date_mulai` datetime DEFAULT NULL,
  `date_selesai` datetime DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='kegiatan produksi pengolahan material';

DROP TABLE IF EXISTS `c_produksi_kegiatan_karyawan`;
CREATE TABLE `c_produksi_kegiatan_karyawan` (
  `id` int(11) NOT NULL,
  `c_produksi_kegiatan_id` int(11) NOT NULL,
  `b_karyawan_id` int(11) NOT NULL,
  `a_pekerjaan_id` int(11) DEFAULT NULL,
  `upah_dasar` float NOT NULL DEFAULT '0',
  `qty_target` decimal(6,2) NOT NULL DEFAULT '0.00',
  `satuan_target` varchar(78) NOT NULL DEFAULT 'Pcs',
  `upah_target` float NOT NULL COMMENT 'upah dasar dikali qty target',
  `qty_selesai` decimal(6,2) NOT NULL,
  `satuan_selesai` varchar(78) NOT NULL DEFAULT 'Pcs',
  `upah_selesai` float NOT NULL COMMENT 'qty selesai dikali upah dasar'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='kegiatan Karyawan';

DROP TABLE IF EXISTS `c_produktag`;
CREATE TABLE `c_produktag` (
  `id` int(11) NOT NULL,
  `nama` varchar(255) NOT NULL,
  `slug` varchar(255) NOT NULL,
  `mtitle` varchar(255) NOT NULL,
  `mkeyword` varchar(255) NOT NULL,
  `mdescription` varchar(255) NOT NULL,
  `image` varchar(255) NOT NULL,
  `deskripsi` text NOT NULL,
  `is_active` int(1) NOT NULL DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `c_produk_custom`;
CREATE TABLE `c_produk_custom` (
  `id` int(11) NOT NULL,
  `c_produk_id` int(11) DEFAULT NULL,
  `tipe` varchar(255) NOT NULL DEFAULT 'Embroidery / Bordir',
  `lokasi` varchar(255) NOT NULL DEFAULT 'depan',
  `maks_warna` int(2) NOT NULL DEFAULT '1',
  `bisa_teks` int(1) NOT NULL DEFAULT '1',
  `bisa_file` int(1) NOT NULL DEFAULT '1',
  `is_active` int(1) NOT NULL DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `c_produk_foto`;
CREATE TABLE `c_produk_foto` (
  `id` int(11) NOT NULL,
  `c_produk_id` int(11) NOT NULL,
  `utype` enum('internal','external') NOT NULL DEFAULT 'internal',
  `jenis` enum('foto','video') NOT NULL DEFAULT 'foto',
  `url` varchar(255) NOT NULL,
  `url_thumb` varchar(255) NOT NULL,
  `caption` varchar(255) NOT NULL,
  `is_active` int(1) NOT NULL DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='untuk foto produk';


DROP TABLE IF EXISTS `c_produk_komposisi`;
CREATE TABLE `c_produk_komposisi` (
  `id` int(11) NOT NULL,
  `c_produk_id` int(11) NOT NULL COMMENT 'id produk utama',
  `c_produk_id_komposisi` int(11) NOT NULL COMMENT 'id produk komposisi',
  `qty` float NOT NULL DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `c_promo`;
CREATE TABLE `c_promo` (
  `id` int(11) NOT NULL,
  `utype` enum('internal','external') NOT NULL DEFAULT 'internal' COMMENT 'jenis url link internal situs atau outside situs',
  `judul` varchar(255) NOT NULL,
  `teks` varchar(255) NOT NULL,
  `url` varchar(255) NOT NULL DEFAULT '#' COMMENT 'url link',
  `gambar` varchar(255) NOT NULL,
  `priority` int(3) NOT NULL DEFAULT '0' COMMENT '0 tinggi 99 rendah',
  `is_active` int(1) NOT NULL DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='tabel slider promo';


DROP TABLE IF EXISTS `c_promosi`;
CREATE TABLE `c_promosi` (
  `id` int(11) NOT NULL,
  `a_pengguna_id` int(11) DEFAULT NULL,
  `a_company_id` int(11) DEFAULT NULL,
  `b_kategori_id` int(11) DEFAULT NULL,
  `b_kategori_nama` varchar(255) NOT NULL,
  `nama` varchar(255) NOT NULL,
  `utype` enum('persentase','nominal','gratis_ongkir','buy_x_get_y','gratis_semua') NOT NULL DEFAULT 'persentase',
  `ptype` varchar(64) NOT NULL COMMENT 'jenis pelanggan b_usergroup',
  `kode` varchar(64) DEFAULT NULL COMMENT 'kode voucher',
  `adate` datetime DEFAULT NULL,
  `edate` datetime DEFAULT NULL,
  `persentase` decimal(6,3) NOT NULL DEFAULT '0.000',
  `nominal` float NOT NULL DEFAULT '0',
  `min_order` float NOT NULL DEFAULT '0',
  `max_order` float NOT NULL DEFAULT '0',
  `max_jml` int(6) NOT NULL DEFAULT '0' COMMENT 'maks jml pemakaian',
  `max_nominal` float NOT NULL DEFAULT '0' COMMENT 'maks nominal diskon',
  `is_after_diskon` int(1) NOT NULL DEFAULT '1' COMMENT 'nominal after diskon',
  `is_gratis_order` int(1) NOT NULL DEFAULT '0',
  `is_gratis_ongkir` int(1) NOT NULL DEFAULT '0',
  `is_batas_user` int(1) NOT NULL,
  `is_batas_tgl` int(1) NOT NULL,
  `is_chained` int(1) NOT NULL DEFAULT '0' COMMENT '0 dont rel, 1 rel to other diskon',
  `is_active` int(1) NOT NULL,
  `prioritas` int(2) NOT NULL DEFAULT '1' COMMENT '1 atas, 99 bawah'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='tabel promosi';


DROP TABLE IF EXISTS `d_blog`;
CREATE TABLE `d_blog` (
  `id` int(11) NOT NULL,
  `a_pengguna_id` int(11) DEFAULT NULL,
  `kategori` varchar(255) NOT NULL DEFAULT 'Uncategorized',
  `title` varchar(255) NOT NULL,
  `slug` varchar(255) NOT NULL,
  `mtitle` varchar(255) NOT NULL,
  `mkeyword` varchar(255) NOT NULL,
  `mdescription` varchar(255) NOT NULL,
  `mauthor` varchar(255) NOT NULL,
  `mimage` varchar(255) NOT NULL,
  `content` text NOT NULL,
  `excerpt` varchar(255) NOT NULL,
  `tags` varchar(255) NOT NULL,
  `featured_image` varchar(255) NOT NULL,
  `homepage_position` int(2) NOT NULL DEFAULT '0' COMMENT '1=row 1 full, 2=row 2 col-1-s, 3= row 2 col-2 l, 4=row-3-col-1-m,5 row-3-col-2-m',
  `cdate` datetime NOT NULL,
  `status` enum('draft','publish','private') NOT NULL DEFAULT 'draft'
) ENGINE=MyISAM DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `d_instagram`;
CREATE TABLE `d_instagram` (
  `id` varchar(20) NOT NULL,
  `ig_user_id` varchar(64) NOT NULL,
  `ig_user_name` varchar(255) NOT NULL,
  `ig_timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `ig_link` varchar(255) NOT NULL,
  `ig_thumb` varchar(255) NOT NULL,
  `ig_media` varchar(255) NOT NULL,
  `ig_caption` text NOT NULL,
  `priority` int(2) NOT NULL DEFAULT '0',
  `is_active` int(1) NOT NULL DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `d_kabkota`;
CREATE TABLE `d_kabkota` (
  `id` int(11) NOT NULL,
  `provinsi_id` int(11) NOT NULL,
  `nama_kabkota` varchar(255) NOT NULL,
  `latitude` varchar(255) NOT NULL,
  `longitude` varchar(255) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `d_kecamatan`;
CREATE TABLE `d_kecamatan` (
  `id` int(11) NOT NULL,
  `kabkota_id` int(11) NOT NULL,
  `nama_kecamatan` varchar(255) NOT NULL,
  `latitude` varchar(255) NOT NULL,
  `longitude` varchar(255) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `d_kelurahan`;
CREATE TABLE `d_kelurahan` (
  `id` int(11) NOT NULL,
  `kecamatan_id` int(11) NOT NULL,
  `nama_kelurahan` varchar(255) NOT NULL,
  `latitude` varchar(255) NOT NULL,
  `longitude` varchar(255) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `d_kodepos`;
CREATE TABLE `d_kodepos` (
  `id` int(11) NOT NULL,
  `kelurahan_id` int(11) NOT NULL,
  `no_kodepos` varchar(15) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `d_mutasi`;
CREATE TABLE `d_mutasi` (
  `id` int(11) NOT NULL,
  `dari_company_id` int(11) NOT NULL COMMENT 'id cabang',
  `dari_company_nama` varchar(255) DEFAULT NULL,
  `ke_company_id` int(11) DEFAULT NULL,
  `ke_company_nama` varchar(255) NOT NULL DEFAULT 'Pusat',
  `permintaan_pengguna_id` int(11) NOT NULL COMMENT 'relasi ke a_pengguna_id',
  `permintaan_pengguna_nama` varchar(255) NOT NULL DEFAULT 'Admin',
  `permintaan_pengguna_username` varchar(255) NOT NULL DEFAULT 'admin',
  `persetujuan_pengguna_id` int(11) DEFAULT NULL COMMENT 'relasi ke a_pengguna_id',
  `persetujuan_pengguna_nama` varchar(255) DEFAULT NULL,
  `persetujuan_pengguna_username` varchar(255) DEFAULT NULL,
  `pengguna_pengiriman` int(11) DEFAULT NULL COMMENT 'relasi ke a_pengguna_id',
  `pengguna_penerimaan` int(11) DEFAULT NULL COMMENT 'relasi ke a_pengguna_id',
  `kode_permintaan` varchar(78) NOT NULL,
  `kode_persetujuan` varchar(78) NOT NULL,
  `kode_pengiriman` varchar(78) NOT NULL,
  `kode_penerimaan` varchar(78) NOT NULL,
  `tgl_permintaan` datetime NOT NULL,
  `tgl_persetujuan` datetime DEFAULT NULL,
  `tgl_pengiriman` datetime DEFAULT NULL,
  `tgl_penerimaan` datetime DEFAULT NULL,
  `apoteker` varchar(255) NOT NULL,
  `sipa` varchar(255) NOT NULL,
  `sia` varchar(255) NOT NULL,
  `alamat` varchar(255) NOT NULL,
  `permintaan_catatan` varchar(255) NOT NULL,
  `persetujuan_catatan` varchar(255) DEFAULT NULL,
  `is_draft` int(1) NOT NULL DEFAULT '1',
  `is_parsial` int(1) NOT NULL DEFAULT '0',
  `is_setuju` int(1) NOT NULL DEFAULT '0',
  `is_ditolak` int(1) NOT NULL DEFAULT '0',
  `is_dikirim` int(1) NOT NULL DEFAULT '0',
  `is_terima` int(1) NOT NULL DEFAULT '0',
  `is_selisih` int(1) NOT NULL DEFAULT '0',
  `is_active` int(1) NOT NULL DEFAULT '1',
  `status_teks` varchar(64) NOT NULL DEFAULT 'draft'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='tabel permintaan, pengiriman, dan penerimaan barang internal';

DROP TABLE IF EXISTS `d_mutasi_barang`;
CREATE TABLE `d_mutasi_barang` (
  `id` int(11) NOT NULL,
  `c_mutasi_id` int(11) NOT NULL,
  `c_produk_id` int(11) NOT NULL,
  `batch_no` varchar(150) NOT NULL,
  `sku` varchar(255) NOT NULL,
  `qty_permintaan` int(4) NOT NULL DEFAULT '0',
  `qty_persetujuan` int(4) DEFAULT '0',
  `qty_pengiriman` int(4) NOT NULL DEFAULT '0',
  `qty_penerimaan` int(4) NOT NULL DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `d_order`;
CREATE TABLE `d_order` (
  `id` int(11) NOT NULL,
  `a_company_id` int(11) DEFAULT NULL,
  `a_toko_id` int(11) DEFAULT NULL COMMENT 'jika terjadi pembelian di toko',
  `b_user_id` int(11) DEFAULT NULL,
  `b_user_store_id` int(11) DEFAULT NULL COMMENT 'untuk toko dropshipper',
  `c_promo_id` int(11) DEFAULT NULL,
  `kode` varchar(64) NOT NULL,
  `utype` enum('cart','cart_abandoned','order_konfirmasi','order_konfirmasi_sudah','order_cekstok','order_pembelian','order_store','order_qc','order_packing','order_kirim','order_selesai','order_batal','order_pending','order_retur') NOT NULL DEFAULT 'cart',
  `date_cart` datetime NOT NULL,
  `date_order` datetime NOT NULL,
  `date_order_konfirmasi` datetime NOT NULL,
  `date_order_konfirmasi_sudah` datetime NOT NULL,
  `date_order_konfirmasi_auto` datetime NOT NULL,
  `date_order_proses` datetime NOT NULL,
  `date_order_pembelian` datetime NOT NULL,
  `date_store` datetime NOT NULL,
  `date_order_qc` datetime NOT NULL,
  `date_order_packing` datetime NOT NULL,
  `date_order_kirim` datetime NOT NULL,
  `date_order_selesai` datetime DEFAULT NULL,
  `date_order_batal` datetime NOT NULL,
  `date_order_pending` datetime NOT NULL,
  `date_credit_return` datetime NOT NULL,
  `date_credit_wait` datetime NOT NULL,
  `date_credit_terima` datetime NOT NULL,
  `date_credit_refund` datetime NOT NULL,
  `pengirim_logo` varchar(255) NOT NULL COMMENT 'diambil dari logo toko user',
  `pengirim_nama` varchar(255) NOT NULL COMMENT 'ini diambil dari nama toko',
  `pengirim_telp` varchar(32) NOT NULL,
  `pengirim_alamat` varchar(255) NOT NULL,
  `pengirim_kelurahan` varchar(150) NOT NULL,
  `pengirim_kecamatan` varchar(150) NOT NULL,
  `pengirim_kabkota` varchar(150) NOT NULL,
  `pengirim_provinsi` varchar(150) NOT NULL,
  `pengirim_negara` varchar(150) NOT NULL,
  `penerima_nama` varchar(255) NOT NULL,
  `penerima_telp` varchar(32) NOT NULL,
  `penerima_alamat` varchar(255) NOT NULL,
  `penerima_kelurahan` varchar(150) NOT NULL,
  `penerima_kecamatan` varchar(150) NOT NULL,
  `penerima_kabkota` varchar(150) NOT NULL,
  `penerima_provinsi` varchar(150) NOT NULL,
  `penerima_negara` varchar(150) NOT NULL DEFAULT 'ID',
  `penerima_kodepos` varchar(25) NOT NULL,
  `penerima_catatan` text NOT NULL,
  `foto_transfer` varchar(255) DEFAULT '',
  `foto_qc` varchar(255) NOT NULL DEFAULT '',
  `foto_packing` varchar(255) NOT NULL DEFAULT '',
  `foto_resi` varchar(255) NOT NULL DEFAULT '',
  `kurir` varchar(255) NOT NULL DEFAULT 'WAHANA' COMMENT 'nama layanan kurir, contoh JNE REG',
  `kurir_catatan` varchar(255) NOT NULL,
  `pembayaran` varchar(128) NOT NULL,
  `noresi` varchar(255) NOT NULL COMMENT 'nomor resi',
  `item_total` int(11) NOT NULL COMMENT 'jumlah satuan dalam pcs',
  `berat_total` int(11) NOT NULL COMMENT 'satuan gram',
  `ongkir` int(11) NOT NULL COMMENT 'dalam RP',
  `biaya_admin` int(11) NOT NULL COMMENT 'dalam RP',
  `sub_total` int(11) NOT NULL COMMENT 'jumlah total semua produk yang dibeli DIKURANGI diskon per produk dalam RP',
  `diskon_voucher` float NOT NULL DEFAULT '0',
  `diskon_total` float NOT NULL COMMENT 'dalam RP',
  `faktor_kodeunik` int(5) NOT NULL COMMENT 'kode unik untuk auto konfirm order bisa 3-4 digit',
  `grand_total` float NOT NULL COMMENT 'dalam RP',
  `dibayar` float NOT NULL,
  `confirm_tgl` date NOT NULL,
  `confirm_ke` varchar(78) NOT NULL,
  `confirm_nom` float NOT NULL,
  `confirm_cara` varchar(78) NOT NULL,
  `confirm_dari` varchar(78) NOT NULL COMMENT 'dari bank',
  `confirm_nama` varchar(255) NOT NULL,
  `confirm_norek` varchar(48) NOT NULL,
  `confirm_bukti` varchar(255) NOT NULL,
  `confirm_by` int(11) DEFAULT NULL COMMENT 'id from a_pengguna',
  `purchased_by` int(11) DEFAULT NULL COMMENT 'id from a_pengguna',
  `qc_by` int(11) DEFAULT NULL COMMENT 'id from a_pengguna',
  `packing_by` int(11) DEFAULT NULL COMMENT 'id from a_pengguna',
  `catatan_admin` text NOT NULL,
  `credit_item` int(11) NOT NULL,
  `credit_return` float NOT NULL COMMENT 'nominal yang dibayarkan ke vendor / gudang',
  `credit_refund` float NOT NULL COMMENT 'nominal yang dibayarkan ke customer',
  `credit_reason` varchar(255) NOT NULL,
  `kode_redeem` varchar(64) NOT NULL,
  `kode_voucher` varchar(255) NOT NULL DEFAULT '',
  `pick_at` varchar(255) NOT NULL,
  `pick_date` date DEFAULT NULL,
  `pick_ready` int(1) NOT NULL DEFAULT '0',
  `is_pickinstore` int(1) NOT NULL DEFAULT '0',
  `is_order_sub` int(1) NOT NULL DEFAULT '0' COMMENT '1 sub_order relasi',
  `is_hidden` int(1) NOT NULL DEFAULT '0',
  `is_offline` int(1) NOT NULL DEFAULT '0',
  `d_order_id` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='tabel cart n order';


DROP TABLE IF EXISTS `d_order_detail`;
CREATE TABLE `d_order_detail` (
  `id` int(11) NOT NULL,
  `d_order_id` int(11) NOT NULL,
  `c_produk_id` int(11) NOT NULL,
  `ldate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'last update ',
  `sku` varchar(255) NOT NULL,
  `ukuran` varchar(255) NOT NULL,
  `warna` varchar(255) NOT NULL,
  `rasa` varchar(255) NOT NULL,
  `harga_asal` float NOT NULL COMMENT 'harga asal yang ada di table produk',
  `harga_jadi` float NOT NULL COMMENT 'harga yang diisi setelah diskon',
  `qty` int(11) NOT NULL,
  `qty_ready` int(11) NOT NULL COMMENT 'qty item yang udah ready',
  `qty_po` int(11) NOT NULL COMMENT 'qty yang harus di beli dulu',
  `qty_kirim` int(11) NOT NULL,
  `berat` int(11) NOT NULL COMMENT 'berat dari produk di KALI QTY',
  `diskon_item` float NOT NULL DEFAULT '0',
  `diskon_total` float NOT NULL DEFAULT '0',
  `sub_total` float NOT NULL COMMENT 'subtotal dari harga_jadi di KALI qty',
  `qty_return` int(11) NOT NULL COMMENT 'total qty yang direturn',
  `berat_return` int(11) NOT NULL COMMENT 'dalam gram yang direturn',
  `sub_total_return` float NOT NULL COMMENT 'nominal barang harga*qty',
  `kurir_return` varchar(100) NOT NULL COMMENT 'nama kurirnya',
  `noresi_return` varchar(255) NOT NULL COMMENT 'nomor resinya',
  `credit_catatan` varchar(255) NOT NULL COMMENT 'catatan',
  `is_returned` int(1) NOT NULL DEFAULT '0',
  `is_credit` int(1) NOT NULL DEFAULT '0',
  `order_status` varchar(255) NOT NULL DEFAULT '',
  `credit_status` varchar(255) NOT NULL DEFAULT '' COMMENT 'untuk proses retur'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='isinya produk yang dibeli, qty dan subtotalnya';


DROP TABLE IF EXISTS `d_pesan`;
CREATE TABLE `d_pesan` (
  `id` int(11) NOT NULL,
  `b_user_id` int(11) NOT NULL,
  `d_order_id` int(11) DEFAULT NULL,
  `b_user_nama` varchar(50) NOT NULL,
  `utype` enum('pesan','tiket','konsultasi') NOT NULL DEFAULT 'konsultasi',
  `kategori` varchar(255) NOT NULL,
  `judul` varchar(255) NOT NULL,
  `isi` text NOT NULL,
  `cdate` datetime NOT NULL,
  `ldate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `is_read` int(1) NOT NULL DEFAULT '0',
  `is_reply` int(1) NOT NULL DEFAULT '0',
  `is_complain` int(11) NOT NULL DEFAULT '0',
  `d_pesan_id` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `d_pesan_file`;
CREATE TABLE `d_pesan_file` (
  `id` int(11) NOT NULL,
  `d_pesan_id` int(11) NOT NULL,
  `utype` enum('internal','external') NOT NULL DEFAULT 'internal',
  `jenis` enum('foto','video') NOT NULL DEFAULT 'foto',
  `url` varchar(255) NOT NULL,
  `url_thumb` varchar(255) NOT NULL,
  `caption` varchar(255) NOT NULL,
  `is_active` int(1) NOT NULL DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='untuk foto produk';


DROP TABLE IF EXISTS `d_provinsi`;
CREATE TABLE `d_provinsi` (
  `id` int(11) NOT NULL,
  `negara_id` int(11) NOT NULL DEFAULT '1',
  `nama_provinsi` varchar(255) NOT NULL,
  `latitude` varchar(255) NOT NULL,
  `longitude` varchar(255) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `d_slider`;
CREATE TABLE `d_slider` (
  `id` int(11) NOT NULL,
  `jenis` enum('web','mobile') NOT NULL DEFAULT 'web',
  `utype` enum('internal','external') NOT NULL DEFAULT 'internal',
  `image` varchar(255) NOT NULL,
  `caption` varchar(255) NOT NULL,
  `url` varchar(255) NOT NULL,
  `priority` int(2) NOT NULL DEFAULT '0' COMMENT '0= urutan atas, 99=bawah',
  `is_active` int(1) NOT NULL DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='slider promo untuk web dan mobile';


DROP TABLE IF EXISTS `d_transaksi`;
CREATE TABLE `d_transaksi` (
  `id` int(11) NOT NULL,
  `b_user_id` int(11) NOT NULL,
  `c_jurnal_id` int(11) DEFAULT NULL,
  `utype` enum('penjualan','biaya') NOT NULL DEFAULT 'penjualan',
  `ftype` enum('pembayaran','tagihan') NOT NULL DEFAULT 'pembayaran',
  `kode` varchar(255) NOT NULL,
  `cdate` datetime NOT NULL COMMENT 'issued date',
  `sdate` datetime DEFAULT NULL COMMENT 'start date',
  `edate` datetime DEFAULT NULL COMMENT 'due date',
  `mata_uang` varchar(4) NOT NULL DEFAULT 'IDR',
  `kurs` float NOT NULL DEFAULT '1',
  `subtotal` float NOT NULL DEFAULT '0',
  `total` float NOT NULL DEFAULT '0',
  `dibayar` float NOT NULL DEFAULT '0',
  `sisa` float NOT NULL DEFAULT '0',
  `ringkasan` text NOT NULL,
  `ustatus` enum('menunggu_pembayaran','dibayar','ditutup') NOT NULL DEFAULT 'menunggu_pembayaran',
  `e_transaksi_id` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `d_transaksi_detail`;
CREATE TABLE `d_transaksi_detail` (
  `id` int(11) NOT NULL,
  `d_transaksi_id` int(11) NOT NULL,
  `c_produk_id` int(11) NOT NULL,
  `deskripsi` int(11) NOT NULL,
  `harga` float NOT NULL,
  `harga_diskon` float NOT NULL,
  `qty` float NOT NULL,
  `pajak_rp` float NOT NULL,
  `pajak_persen` decimal(4,2) NOT NULL,
  `c_jurnal_id_pajak` float NOT NULL,
  `total` float NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='transaksi detail berisi produk, barang, jasa';

DROP TABLE IF EXISTS `e_custom`;
CREATE TABLE `e_custom` (
  `id` int(11) NOT NULL,
