  `tgl_pesan` datetime NOT NULL,
  `tgl_bayar` datetime DEFAULT NULL,
  `tgl_konfirmasi` datetime DEFAULT NULL,
  `tgl_proses` datetime DEFAULT NULL,
  `tgl_proses_sampel` datetime DEFAULT NULL,
  `tgl_proses_konfirmasi` datetime DEFAULT NULL,
  `tgl_proses_beli` datetime DEFAULT NULL,
  `tgl_proses_produksi` datetime DEFAULT NULL,
  `tgl_proses_produksi_estimasi` datetime DEFAULT NULL,
  `tgl_proses_produksi_selesai` datetime DEFAULT NULL,
  `tgl_proses_qc` int(11) NOT NULL,
  `tgl_proses_packing` int(11) NOT NULL,
  `tgl_proses_kirim` int(11) NOT NULL,
  `tgl_selesai` int(11) NOT NULL,
  `a_pengguna_id_konfirmasi` int(11) DEFAULT NULL,
  `a_pengguna_id_sampel` int(11) DEFAULT NULL,
  `a_pengguna_id_proses` int(11) DEFAULT NULL,
  `a_pengguna_id_beli` int(11) DEFAULT NULL,
  `a_pengguna_id_produksi` int(11) DEFAULT NULL,
  `a_pengguna_id_qc` int(11) DEFAULT NULL,
  `a_pengguna_id_packing` int(11) DEFAULT NULL,
  `a_pengguna_id_kirim` int(11) DEFAULT NULL,
  `status_teks` varchar(255) NOT NULL DEFAULT 'konfirmasi_belum',
  `status_kode` int(2) NOT NULL DEFAULT '2',
  `kirim_nama` varchar(255) NOT NULL,
  `kirim_email` varchar(255) NOT NULL,
  `kirim_telp` varchar(255) NOT NULL,
  `kirim_alamat` varchar(255) NOT NULL,
  `kirim_kelurahan` varchar(255) NOT NULL,
  `kirim_kecamatan` varchar(255) NOT NULL,
  `kirim_kabkota` varchar(255) NOT NULL,
  `kirim_provinsi` varchar(255) NOT NULL,
  `kirim_negara` varchar(24) NOT NULL DEFAULT 'ID',
