  `produk_kategori_nama` varchar(255) NOT NULL DEFAULT '-',
  `produk_nama` varchar(255) NOT NULL DEFAULT '-',
  `produk_berat` float NOT NULL DEFAULT '0',
  `produk_harga` float NOT NULL DEFAULT '0',
  `custom_depan` int(1) NOT NULL DEFAULT '0',
  `custom_depan_mode` enum('teks','file') NOT NULL DEFAULT 'teks',
