  `custom_depan_teks` varchar(255) NOT NULL,
  `custom_depan_font` varchar(255) NOT NULL,
  `custom_depan_warna` varchar(9) NOT NULL DEFAULT '#000000',
  `custom_depan_file` varchar(255) NOT NULL DEFAULT '',
  `custom_depan_harga` float NOT NULL DEFAULT '0',
  `custom_belakang` int(1) NOT NULL DEFAULT '0',
  `custom_belakang_mode` enum('file','teks') NOT NULL DEFAULT 'teks',
  `custom_belakang_posisi` varchar(255) NOT NULL DEFAULT '-',
  `custom_belakang_teks` varchar(255) NOT NULL,
  `custom_belakang_font` varchar(255) NOT NULL,
  `custom_belakang_warna` varchar(9) NOT NULL DEFAULT '#000000',
  `custom_belakang_file` varchar(255) NOT NULL DEFAULT '-',
  `custom_belakang_harga` float NOT NULL DEFAULT '0',
  `custom_harga` float NOT NULL DEFAULT '0',
  `custom_qty` int(7) NOT NULL,
  `produk_warna` varchar(255) NOT NULL DEFAULT '-',
  `produk_ukuran` varchar(255) NOT NULL DEFAULT 'All Size',
  `total_produk` float NOT NULL,
  `total_custom` float NOT NULL,
  `total_biaya` float NOT NULL,
  `total` float NOT NULL,
  `is_active` int(1) NOT NULL DEFAULT '1'
