DROP TABLE IF EXISTS `e_jne`;
CREATE TABLE `e_jne` (
  `id` int(11) NOT NULL,
  `origin` varchar(255) NOT NULL DEFAULT 'BANDUNG',
  `kode_jne` varchar(255) DEFAULT NULL,
  `kecamatan` varchar(255) DEFAULT NULL,
  `kabkota` varchar(255) DEFAULT NULL,
  `propinsi` varchar(255) DEFAULT NULL,
  `oke15_tarif` float DEFAULT NULL,
  `oke15_est` varchar(8) NOT NULL DEFAULT '7-14',
  `reg15_tarif` float DEFAULT NULL,
  `reg15_est` varchar(8) NOT NULL DEFAULT '4-10',
  `yes15_tarif` float DEFAULT NULL,
  `yes15_est` varchar(8) NOT NULL DEFAULT '1-4',
  `status` int(1) DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `e_jnt`;
CREATE TABLE `e_jnt` (
  `id` int(11) NOT NULL,
  `origin` varchar(255) DEFAULT 'BANDUNG',
  `provinsi` varchar(255) NOT NULL DEFAULT '',
  `kabkota` varchar(30) DEFAULT NULL,
  `kecamatan` varchar(30) DEFAULT NULL,
  `reg_tarif` float NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `e_ninjatarif`;
CREATE TABLE `e_ninjatarif` (
  `id` int(11) NOT NULL,
  `origin` varchar(255) NOT NULL DEFAULT 'BANDUNG',
  `nxp_zone` varchar(255) DEFAULT NULL,
  `next_day_tarif` varchar(255) DEFAULT NULL,
  `standar_tarif` varchar(255) DEFAULT NULL,
