  `nxp_zone` varchar(255) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `e_pembelian`;
CREATE TABLE `e_pembelian` (
  `id` int(11) NOT NULL,
  `a_vendor_id` int(11) NOT NULL,
  `a_pengguna_id` int(11) DEFAULT NULL COMMENT 'yang membeli',
  `a_gudang_id` int(11) DEFAULT NULL COMMENT 'tujuan gudang',
  `kendaraan_id` int(11) DEFAULT NULL COMMENT 'diambil dari b_barang_id',
  `kode` varchar(255) NOT NULL COMMENT 'nomor purchasing',
  `date_create` datetime NOT NULL,
  `date_pembelian` datetime DEFAULT NULL,
  `date_selesai` datetime DEFAULT NULL,
  `uang_bawa` float NOT NULL COMMENT 'uang yang dibawa dari finance',
  `order_qty` int(11) NOT NULL,
  `order_total` float NOT NULL COMMENT 'dalam rupiah',
  `dibeli_qty` int(11) NOT NULL,
  `dibeli_total` float NOT NULL COMMENT 'dalam rupiah',
  `terima_qty` int(11) NOT NULL,
  `terima_total` float NOT NULL COMMENT 'dalam rupiah',
  `uang_kembali` float NOT NULL,
  `created_by` int(11) DEFAULT NULL COMMENT 'dari a_pengguna_id yang membuat faktur',
  `accepted_by` int(11) DEFAULT NULL COMMENT 'petugas gudang',
  `ep_status` enum('wait','progress','finish','cancel') NOT NULL DEFAULT 'wait'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='ini tabel master untuk pembelian utama';

DROP TABLE IF EXISTS `e_pembelian_produk`;
CREATE TABLE `e_pembelian_produk` (
  `id` int(11) NOT NULL,
  `e_pembelian_id` int(11) NOT NULL,
  `c_produk_id` int(11) NOT NULL,
  `a_gudang_id` int(11) DEFAULT NULL,
  `a_pengguna_id` int(11) DEFAULT NULL COMMENT 'yang menerima hasil pembelian',
  `utype` varchar(78) NOT NULL DEFAULT 'pakaian',
  `date_expire` date NOT NULL DEFAULT '0000-00-00',
  `order_qty` int(11) NOT NULL COMMENT 'jumlah qty dari order',
  `order_subtotal` float NOT NULL COMMENT 'diambil dari produk harga beli KALI qty_beli',
  `dibeli_qty` int(11) NOT NULL,
  `dibeli_subtotal` float NOT NULL,
  `diterima_qty` int(11) NOT NULL,
  `diterima_subtotal` float NOT NULL,
  `catatan_pembeli` varchar(255) NOT NULL,
  `catatan_penerima` varchar(255) NOT NULL,
  `order_ids` text NOT NULL COMMENT 'untuk d_order_id dipisahkan oleh koma',
  `date_diterima` datetime NOT NULL COMMENT 'waktu ketika di terima oleh gudang'
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='list pembelian produk';

DROP TABLE IF EXISTS `e_retur`;
CREATE TABLE `e_retur` (
  `id` int(11) NOT NULL,
  `dari_a_company_id` int(11) NOT NULL,
  `ke_a_company_id` int(11) NOT NULL,
  `a_pengguna_id` int(11) NOT NULL,
  `kode` varchar(78) NOT NULL,
  `tgl_pengajuan` datetime NOT NULL,
  `tgl_konfirmasi` datetime DEFAULT NULL,
  `tgl_terima` datetime DEFAULT NULL,
  `tgl_proses` datetime DEFAULT NULL,
  `tgl_selesai` datetime DEFAULT NULL,
  `is_konfirmasi` int(1) NOT NULL DEFAULT '0',
  `is_terima` int(1) NOT NULL DEFAULT '0',
  `is_proses` int(1) NOT NULL DEFAULT '0',
  `is_selesai` int(1) NOT NULL DEFAULT '0',
  `is_active` int(1) NOT NULL DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `e_retur_barang`;
CREATE TABLE `e_retur_barang` (
  `id` int(11) NOT NULL,
  `e_retur_id` int(11) NOT NULL,
  `b_barang_id` int(11) NOT NULL,
  `a_pengguna_id` int(11) DEFAULT NULL COMMENT 'orang yang memproses',
  `batch_no` varchar(78) NOT NULL,
  `qty_pengajuan` int(4) NOT NULL DEFAULT '0',
  `qty_terima` int(4) NOT NULL DEFAULT '0',
  `qty_rekondisi` int(4) NOT NULL DEFAULT '0',
  `qty_dibuang` int(4) NOT NULL DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS `e_sicepat`;
CREATE TABLE `e_sicepat` (
  `id` int(11) NOT NULL,
  `origin` varchar(255) NOT NULL DEFAULT 'BANDUNG',
  `sicepat_kode` varchar(8) NOT NULL DEFAULT 'BDRS001',
  `kabkota` varchar(34) DEFAULT NULL,
  `kecamatan` varchar(40) DEFAULT NULL,
  `bdonama` varchar(40) NOT NULL DEFAULT 'BANDROS',
  `kabkota_kode` varchar(3) NOT NULL DEFAULT 'BDR',
  `reg15_tarif` float NOT NULL DEFAULT '0',
  `reg15_est` varchar(10) NOT NULL DEFAULT '4-10',
  `best15_tarif` float NOT NULL DEFAULT '0',
  `best15_est` varchar(10) NOT NULL DEFAULT '1-4'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



