INSERT INTO `d_blog` (`id`, `a_pengguna_id`, `kategori`, `title`, `slug`, `mtitle`, `mkeyword`, `mdescription`, `mauthor`, `mimage`, `content`, `excerpt`, `tags`, `featured_image`, `homepage_position`, `cdate`, `status`) VALUES
(1, NULL, 'Promo', 'Cara daftar diundang.com', 'promo-bulan-februari', '', '', '', '', '', '<p>Banyak yang bingung bagaimana cara mendaftar diundang.com. Cukup dengan tiga langkah mudah berikut ini:</p>\r\n\r\n<ol>\r\n	<li>Buka <a href=\"https://diundang.com/customer/account/login\" title=\"Halaman Pendaftaran Diundang.com\">halaman pendaftaran</a></li>\r\n	<li>Kemudian isi email dan nama lengkapi.</li>\r\n	<li>Setelah diisi otomatis akan masuk ke halaman dashboard.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Selamat, kaka sudah terdaftar di diundang.com. Jangan lupa ganti password nya ya Kak!&nbsp;<img alt=\"cool\" src=\"https://diundang.com/assets/js/tinymce/plugins/emoticons/img/smiley-cool.gif\" /></p>\r\n', 'Banyak yang bingung bagaimana cara mendaftar diundang.com, lihat artikel ini selengkapnya', '', 'media/upload/2018/08/kenisha-scarf-navy.jpg', 0, '2018-08-15 15:16:20', 'publish'),
(2, NULL, 'Berita', 'Follow IG Diundang.com', 'follow-ig-diundang-com', 'Follow IG Diundang.com', 'Follow IG Diundang.com', 'Follow IG Diundang.com', '', '', '<p>Tadinya gabakalan bikin IG, tapi ya sudahlah karena orang lain bikin jadi kita bikin juga.</p>\r\n\r\n<p>Jangan lupa follow ya <a href=\"https://www.instagram.com/diundangdotcom\" target=\"_blank\" title=\"IG Diundang.com\">IG kita </a>ya.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Tadinya gabakalan bikin IG, tapi ya sudahlah karena orang lain bikin jadi kita bikin juga. Jangan lupa follow ya', '', 'media/upload/2018/08/zahidin-menswear.jpg', 0, '2018-08-15 16:07:17', 'publish'),
(4, NULL, 'Tips &amp; Trik', 'Memilih Gedung Pernikahan', 'Memilih Gedung Pernikahan', 'Memilih Gedung Pernikahan', 'Memilih Gedung Pernikahan', 'Memilih Gedung Pernikahan', 'diundang.com', '', '<p>Bagi yang belum tahu, memilih gedung pernikahan tentu harus dari jauh hari.</p>\r\n', 'Bagi yang belum tahu, memilih gedung pernikahan tentu harus dari jauh hari.', '', 'media/upload/2018/08/kenisha-scarf-navy.jpg', 0, '2018-08-15 15:24:02', 'publish'),
(6, NULL, 'Review', 'Pentingnya tunangan', 'tunangan-penting', 'Tunangan? Penting?', 'Tunangan? Penting?', 'Tunangan? Penting?', 'Tunangan? Penting?', '', '<p>Untuk sebagian orang tunangan itu merupakan momen terbesar yang terjadi didalam hidupnya, tapi apakah benar demikian?</p>\r\n', 'Untuk sebagian orang tunangan itu merupakan momen terbesar yang terjadi didalam hidupnya, tapi apakah benar demikian?', '', 'media/upload/2018/08/menswear-casual---101.jpg', 3, '2018-08-15 15:24:23', 'publish'),
(7, NULL, 'Tips &amp; Trik', 'Pentingkah Uang Muka menjelang pesta pernikahan?', 'pentingkah-uang-muka-menjelang-pesta-pernikahan', 'Pentingkah Uang Muka menjelang pesta pernikahan?', '', '', '', '', '<p>Mengelola budgeting untuk pesta pernikahan memang sungguh menyita waktu. Tapi sebenarnya, kita tidak boleh berleha-leha.</p>', 'Mengelola budgeting untuk pesta pernikahan memang sungguh menyita waktu. Tapi sebenarnya, kita tidak boleh berleha-leha.', '', 'media/blog/1/0/10974626_919907954707067_5518084760934969195_o.jpg', 3, '2017-11-26 14:20:31', 'publish'),
(8, NULL, 'Tips &amp; Trik', 'Promo Bulan Februari 2017', 'promo-bulan-februari-2017', 'Promo Bulan Februari 2017', 'Promo Bulan Februari 2017', 'Promo Bulan Februari 2017', 'Promo Bulan Februari 2017', 'Promo Bulan Februari 2017', '<p>&nbsp;</p>\r\n<p class=\"p2\">&nbsp;</p>\r\n<p class=\"p1\"><span class=\"s1\">Menyambut bulan kasih-sayang, <a title=\"Undangan Online Pernikahan\" href=\"https://diundang.com/\">diundang.com</a> akan selalu berusaha untuk memberikan layananan terbaik dengan salah satunya memberikan discount dan give away. Yuk simak baik-baik gimana cara buat bisa dapetin promo-promo hebat dari kita...</span>&nbsp;</p>\r\n<ol class=\"ol1\">\r\n<li class=\"li1\"><span class=\"s1\"><span class=\"s1\">Kamu dan pasanganmu akan menikah di tanggal 14 Februari 2017?<br /></span></span><br />Buruan cepet-cepet dafter deh! Kenapa? Karena bagi <strong>pendaftar pertama</strong> yang akan menikah di tanggal 14 Februari 2017 nanti otomatis bakalan dapet give away langsung dari kita berupa <strong>FREE</strong> Jasa Pembuatan UNDANGAN ONLINE senilai <strong>$14 USD</strong>. So, tunggu apalagi daftarkan atau bahkan mungkin kasih tau kerabat kalian yang bakalan nikah di tanggal ini.<br /><br /></li>\r\n<li class=\"li1\"><span class=\"s1\">Gak nikah di tanggal 14 Februari 2017 tapi tetep pengen dapet promo?<br /><br /></span>Nah bagi kalian yang nikah diluar tanggal 14 dibulan Februari 2017 ini jangan khawatir. Kalian masih bisa dapetin promo gila-gilaan berupa discount dengan bermodalkan teman-teman kalian yang ada di medsos. Yups, kalian bisa ajak dan daftarkan temen-temen medsos kalian untuk like, follow dan subscribe account medsos kita berikut:</li>\r\n</ol>\r\n<ul class=\"ul1\">\r\n<li class=\"li1\"><a title=\"Fanpage Facebook diundang.com\" href=\"https://www.facebook.com/diundangcom\" target=\"_blank\">Facebook</a></li>\r\n<li class=\"li1\"><a title=\"Instagram diundang.com\" href=\"https://www.instagram.com/diundangdotcom/\" target=\"_blank\">Instagram</a></li>\r\n<li class=\"li1\"><a title=\"Youtube diundang.com\" href=\"https://www.youtube.com/channel/UC03pGhQLUj781xBc5YMWjMQ\" target=\"_blank\">Youtube</a></li>\r\n</ul>\r\n<p class=\"p1\"><span class=\"s1\">Setiap 1 like/follow/subscribe temen kalian akan kita konversikan menjadi discount senilai Rp1.000,-</span></p>\r\n<p class=\"p1\"><span class=\"s1\">Jadi 1 teman kalian bisa nyumbang maksimal Rp3.000,-&nbsp;</span></p>\r\n<p class=\"p1\"><span class=\"s1\">Punya temen 100 orang yang bisa like/follow/subscribe account kita? maka kalian akan dapatkan discount senilai Rp300,000,-</span></p>\r\n<p class=\"p2\">&nbsp;</p>\r\n<p class=\"p1\"><span class=\"s1\">Lebih Gokil bukan promonya? Yuk makanya daftar buruan, terus ajakin temen-temennya buat turut serta dalam perjuangan pernikahan impian kalian...</span></p>', 'Promo Bulan Februari 2017', '', '', 1, '2017-03-30 20:45:22', 'draft'),
(9, NULL, 'Tips &amp; Trik', 'Kebijakan Privasi', 'kebijakan-privasi', 'Kebijakan Privasi', 'kebijakan privasi', 'Berikut ini adalah kebijakan privasi pengguna diundang.com', '@diundang', '', '<h2>Kebijakan Privasi</h2>\r\n<p>Kami menjaga privasi member dengan serius dan kami hanya akan mengumpulkan dan menggunakan informasi pribadi Anda seperti uraian di bawah ini.</p>\r\n<ul>\r\n<li>Dengan mengunjungi situs nyingspot.com anda berarti setuju terhadap syarat dan ketentuan yang diterapkan oleh kami.</li>\r\n<li>Kami berhak mengumpulkan data browser seperti cookie dan lain-lain untuk digunakan pihak ketiga.</li>\r\n<li>Pihak ketiga disini antara lain: Google Ads, Google Analytic, Facebook Tag, Facebook Remarketing, Add This, dan Google Tag manager.</li>\r\n<li>Situs nyingspot.com tidak pernah meminta anda untuk memberikan email atau data diri anda dengan memaksa.</li>\r\n<li>Setiap informasi yang diterima, diteruskan dari web lain seperti sosial media, search engine dan sebagainya merupakan tanggung jawab daripada pengguna.</li>\r\n<li>Setiap iklan (ads) yang muncul dari situs kami merupakan iklan yang disediakan pihak ketiga. Situs nyingspot.com tidak ada kaitannya dengan isi yang dimunculkan iklan tersebut.</li>\r\n</ul>\r\n<p>Kebijakan Privasi (privacy policy) ini dapat berubah sewaktu-waktu tanpa pemberitahuan terlebih dahulu.</p>', 'Berikut ini adalah kebijakan privasi pengguna diundang.com', '', '', 0, '2017-01-01 10:10:00', 'publish'),
(16, NULL, 'Berita', 'Co-working space is A SPACESHIP?', 'co-working-space-is-a-spaceship', '', '', '', '', '', '<p>Co-working SpaceTeam fund big data prototype prototype long shadow latte big data. Innovate affordances personas user centered design paradigm user centered design innovate quantitative vs. qualitative pivot thought leader viral paradigm cortado affordances.</p>\r\n<h5>An additional point</h5>\r\n<p>Co-working paradigm piverate innovate affordances user centered design personas pair programming Steve Jobs iterate earned media. Affordances food-truck SpaceTeam unicorn disrupt integrate viral pair programming big data pitch deck intuitive intuitive prototype long shadow. Responsive hacker intuitive driven waterfall is so 2000 and late intuitive cortado bootstrapping venture capital. Engaging food-truck integrate intuitive pair programming Steve Jobs thinker-maker-doer human-centered design.</p>\r\n<blockquote>&ldquo; We want everyone to have a great experience building their website &mdash; and with Stack they get just that&rdquo;</blockquote>\r\n<p>Prototype intuitive intuitive thought leader personas parallax paradigm long shadow engaging unicorn SpaceTeam fund ideate paradigm. Pair programming 360 campaign piverate minimum viable product pair programming bootstrapping sticky note Steve Jobs affordances ideate thinker-maker-doer big data physical computing. Workflow driven innovate long shadow SpaceTeam grok pivot.</p>\r\n<ul class=\"bullets\">\r\n<li>Something to say</li>\r\n<li>Listing things in a list</li>\r\n<li>Pay close attention to number 4</li>\r\n<li>What happens next will shock you</li>\r\n</ul>', 'Co-working paradigm piverate innovate affordances user centered design personas pair programming Steve Jobs iterate earned media. Affordances food-truck SpaceTeam unicorn', '', 'media/blog/p/e/peranan-musik-untuk-anak.jpg', 0, '2017-11-28 13:28:43', 'publish'),
(10, NULL, 'Berita', 'Gadget Friendly', 'fitur-standar-responsive-web-design', '', '', '', '', '', '<p>Guys tahukah kalian fitur pertama yang kita miliki merupakan fitur unggulan dari <a href=\"../\" title=\"Undangan Online Pernikahan\">diundang.com</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Karena apa? Karenaaa... Undangan online diundang.com gak cuma bisa enak dilihat pada tampilan PC saja, tapi di semua jenis gadget punya kamu dan teman-teman kamu bakal tetep kece buat diliat&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kenapa bisa gitu? Karenaaa... diundang.com menggunakan teknologi yg terupdate dong pastinya daaan faktanya #kitabukanwordpress&nbsp;</p>\r\n\r\n<p>Mutakhir gak tuh?!</p>\r\n\r\n<p>Makanya hayu atuh buruan daftarin undanganmu hanya diundang.com</p>\r\n', 'Sebagai penyedia jasa layanan undangan online pernikahan, responsive web desain sudah menjadi fitur utama kami. Sehingga memudahkan untuk dibuka di HP, tablet maupun di PC.', '', '', 0, '2018-08-15 16:07:31', 'publish'),
(19, NULL, 'Fashion', 'Tetap Keren dan Santun Saat berolahraga', 'tetap-keren-dan-santun-saat-berolahraga', '', '', '', '', '', '<p>Demi mendapatkan tubuh yang sehat, kita dianjurkan untuk melakukan olahraga setidaknya dua sampai tiga kali dalam seminggu. Namun, sayangnya banyak muslimah yang mengaku mengalami penurunan waktu berolahraga saat mengenakan hijab. Ada begitu banyak alasan yang dikemukakan, salah satunya, bingung dan merasa kesulitan memilih outfit yang cocok saat berolahraga.</p>\r\n\r\n<p>Gerakan berlari dan melompat tentu akan membuat kamu mengeluarkan banyak keringat. Penggunaan pakaian yang panjang menutup aurat tentu menambah tingkat kegerahan saat berolahraga. Oleh sebab itu, kamu harus pintar memilih pakaian berbahan nyaman sehingga memberikan sirkulasi udara yang baik pada kulit.</p>\r\n\r\n<p>Salah satu bahan yang direkomendasikan untuk dipakai saat kita berolahraga adalah bahan katun&nbsp;<em>combed</em>. Katun yang nyaman dan menyerap keringat ini bisa sedikit membantu mengatasi gerah saat kita bergerak. Selain itu pakaian dengan bahan katun&nbsp;<em>combed</em>&nbsp;ini terasa nyaman di kulit sehingga kita bisa tetap nyaman saat berolahraga.</p>\r\n\r\n<p>Untuk menghindari lekuk bentuk tubuh, kamu bisa menggunakan&nbsp;<em>tshirt dry-fit</em>&nbsp;<em>oversize</em>&nbsp;kemudian padukan dengan celana training atau legging khusus muslimah. Biasanya leging muslimah dilengkapi potongan yang menyerupai rok yang menutupi area paha.</p>\r\n\r\n<p><img alt=\"\" src=\"http://shafira.local/media/upload/2018/08/blog-fashion-olahraga.jpg\" /></p>\r\n\r\n<p>Pilihlah warna-warna gelap, seperti hitam, cokelat, abu-abu, biru dongker untuk menyamarkan bentuk tubuh serta memberikan kesan sederhana. Bagi kamu yang ingin melakukan olahraga renang, bisa mengenakan celana legging&nbsp;<em>high waisted</em>&nbsp;yang dipadukan dengan kaos lengan panjang berbahan nilon.</p>\r\n\r\n<p>Saat ini sudah cukup banyak model dan desain baju olahraga yang bisa kita pilih. Jadi tidak lagi sulit untuk tampil stylist<em>&nbsp;nan</em>santun saat berolahraga.&nbsp;<em>So,</em>&nbsp;sudah siap untuk berolahraga besok?</p>\r\n', '', '', 'media/upload/2018/08/blog-fashion-olahraga.jpg', 0, '2018-08-15 16:37:06', 'publish'),
(11, NULL, 'Tips &amp; Trik', 'Video Invitation', 'video-invitation-feature-2', '', '', '', '', '', '<p>&nbsp;</p>\r\n<p class=\"p1\"><span class=\"s1\"><a title=\"Undangan Online Pernikahan\" href=\"../\">diundang.com</a> telah terintegrasi dengan aplikasi youtube?&nbsp;<img src=\"../assets/js/tinymce/plugins/emoticons/img/smiley-surprised.gif\" alt=\"surprised\" /></span><span class=\"s2\"><br /> </span><span class=\"s1\">wow! wow! wow!</span></p>\r\n<p class=\"p1\"><span class=\"s2\"><br /> </span><span class=\"s1\">So, bagi kalian yg memiliki wedding invitation video gak usah ribet posting sana sini, cukup upload sekali di youtube lalu kasih link nya ke kita daaan *taadaaa~~~<img src=\"../assets/js/tinymce/plugins/emoticons/img/smiley-cool.gif\" alt=\"cool\" /> video tersebut akan muncul otomatis dengan Informasi pernikahan kalian lainnya seperti peta lokasi juga loh...</span><span class=\"s2\"><br /> <br /> </span><span class=\"s1\">Cukup share satu link website undangan dari kita uda muat banyak fitur bukan?&nbsp;<img src=\"../assets/js/tinymce/plugins/emoticons/img/smiley-laughing.gif\" alt=\"laughing\" /></span><span class=\"s2\"><br /> <br /> </span><span class=\"s1\">Nah bagi kalian yg gapunya channel youtube gak usah khawatir kita bisa bantu kalian dng cara upload wedding invitation video kalian di <a title=\"Youtube diundang.com\" href=\"https://www.youtube.com/channel/UC03pGhQLUj781xBc5YMWjMQ\" target=\"_blank\">channel</a> kita seperti <a title=\"Video Invitation Azmi-Yusuf\" href=\"https://www.youtube.com/watch?v=Vznflr9LlYI\" target=\"_blank\">video</a>nya ka&nbsp;<a title=\"Instagram Azmiiazizah\" href=\"https://www.instagram.com/azmiiazizah/\" target=\"_blank\"><span class=\"s3\">@azmiiazizah</span></a>&nbsp;satu ini</span><span class=\"s2\"><br /> <br /> </span><span class=\"s1\">Tunggu apalagi buruaaaaaan daftar !!!</span></p>', 'Video invitation bisa dikemas didalam undangan online ini. Azmi Yusuf dengan mengedepankan Tema Natural White, menjadi