(12, NULL, 'Tips &amp; Trik', 'Custom Layout', 'custom-layout-feature-3', '', '', '', '', '', '<p class=\"p1\"><span class=\"s1\">Kalian bisa custom layout undangan online diundang.com sebebas mungkin sesuai keinginan, yang pastinya bakal pas banget dengan apapun tema pernikahan kalian...</span></p>\r\n<p class=\"p2\">&nbsp;</p>\r\n<p class=\"p1\"><span class=\"s1\">Caranya mudah cukup kirimkan desain dan layout yg akan kamu pakai, teruuuus... Jika kamu males buat nyari designer lagi, kalian tinggal hubungi kami saja</span></p>\r\n<p class=\"p2\">&nbsp;</p>\r\n<p class=\"p1\"><span class=\"s1\">Karena apa... ???</span></p>\r\n<p class=\"p1\"><span class=\"s1\">Karena kita juga memiliki partner designer yg kece-kece juga loh ????</span></p>\r\n<p class=\"p2\">&nbsp;</p>\r\n<p class=\"p1\"><span class=\"s1\">Tunggu apalagi segera daftarkan undanganmu hanya <a title=\"Undangan Pernikahan Online\" href=\"../\">diundang.com</a></span></p>\r\n<p class=\"p1\"><span class=\"s1\">Untuk review contoh hasil diundang.com cek link dibawah ini:</span></p>\r\n<p class=\"p1\"><span class=\"s1\">- Undangan Online Pernikahan Vanny &amp; Daeng</span></p>', 'Desain Bebas - Inilah yang tidak ditawarkan oleh penyedia Undangan Online lainnya. Desain bisa sebebas-bebasnya. Mau Gabung sama Kita? Tenang ada komisinya koq :)', '', '', 0, '2017-02-01 09:28:39', 'publish'),
(13, NULL, 'Tips &amp; Trik', 'Ketentuan Cookies', 'ketentuan-cookies', '', '', '', '', '', '<p>&nbsp;</p>\r\n<p>Cookie adalah file teks kecil atau potongan-potongan informasi yang tersimpan dalam komputer atau perangkat mobile Anda (seperti smartphone ataupun tablet) saat Anda berkunjung ke Situs Geevv. Cookie biasanya akan berisikan nama situs web darimana cookie tersebut berasal, dalam hal ini Geevv menyimpan cookie dengan nama Geevv di perangkat Anda. Di dalam cookie terdapat pula informasi terkait \"masa hidup\" cookie (yaitu berapa lama cookie tersebut akan berada dalam perangkat Anda), dan nilai, yang biasanya adalah nomor unik yang dihasilkan secara acak.</p>\r\n<p>&nbsp;</p>\r\n<h2>PENGGUNAAN COOKIE</h2>\r\n<p>&nbsp;</p>\r\n<p>Kami menggunakan cookie untuk membuat Situs kami lebih mudah untuk digunakan dan untuk lebih menyesuaikan Situs dan layanan kami untuk kepentingan dan kebutuhan Anda. Cookie dapat melakukan hal ini karena situs web dapat membaca dan menulis file-file tersebut, memungkinkan mereka untuk mengenal Anda dan mengingat informasi penting yang akan membuat penggunaan Anda atas situs web menjadi lebih mudah (misalnya dengan mengingat pengaturan preferensi).</p>\r\n<p>&nbsp;</p>\r\n<p>Cookie dapat juga digunakan untuk membantu mempercepat kegiatan dan pengalaman Anda di kemudian hari pada Situs kami. Kami juga menggunakan cookie untuk menyusun anonim, agregat statistik yang memungkinkan kami untuk mengerti bagaimana pengguna menggunakan Situs kami dan untuk membantu kami meningkatkan struktur dan konten Situs kami. Kami tidak dapat mengenali Anda secara personal dari informasi ini.</p>\r\n<h3>Cara Mengapus Cookie</h3>\r\n<p>Cara untuk menghapus cookie dari browser Anda :</p>\r\n<p>Internet Explorer &ndash; https://support.microsoft.com/en-us/kb/278835</p>\r\n<p>Chrome - https://support.google.com/accounts/answer/32050?hl=en</p>\r\n<p>Firefox - https://support.mozilla.org/en-US/kb/delete-cookies-remove-info-websites-stored</p>\r\n<p>Safari - https://support.apple.com/kb/ph21411?locale=en_US</p>\r\n<p>Opera - http://www.opera.com/help/tutorials/security/cookies/</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h2>JENIS COOKIE</h2>\r\n<p>&nbsp;</p>\r\n<p>Ada dua jenis cookie yang dapat digunakan dalam Situs kami, yang disebut \"session cookies\" dan \"persistent cookies\". Session cookies adalah cookie sementara yang tetap berada pada perangkat Anda sampai Anda meninggalkan Situs kami. Persistent Cookie tetap berada pada perangkat Anda untuk waktu yang lebih lama atau sampai Anda secara menual menghapusnya (seberapa lama cookie berada dalam perangkat Anda akan bergantung pada durasi atau \"masa hidup\" cookie tersebut).</p>\r\n<p>&nbsp;</p>\r\n<p>COOKIE PIHAK KETIGA</p>\r\n<p>&nbsp;</p>\r\n<p>Kami juga menggunakan beberapa pemasok yang dapat mengatur cookie pada perangkat Anda atas nama kami saat Anda mengunjungi Situs kami untuk memungkinkan pihak ketiga menyampaikan layanan-layanan yang disediakan oleh pihak ketiga tersebut. Cookie pihak ketiga dan penggunaanya tidak diatur dan terikat dengan Ketentuan Cookie ini, tapi Ketentuan Cookie tersendiri. Jika Anda menginginkan informasi selanjutnya mengenai cookie-cookie tersebut, serta informasi mengenai bagaimana untuk memilih tidak menerima cookie-cookie tersebut, silahkan baca Ketentuan Cookie pihak ketiga tersebut.</p>\r\n<p>&nbsp;</p>\r\n<h2>COOKIES YANG KAMI GUNAKAN</h2>\r\n<p>&nbsp;</p>\r\n<p>Di bawah ini kami cantumkan jenis-jenis cookie yang digunakan dalam Situs Geevv. Perlu diketahui bahwa sejauh informasi yang terkumpulkan melalui cookie merupakan informasi pribadi, ketentuan-ketentuan dalam Kebijakan Privasi berlaku dan melengkapi Kebijakan Cookie ini.</p>\r\n<p>&nbsp;</p>\r\n<h3>ESSENTIAL COOKIE</h3>\r\n<p>&nbsp;</p>\r\n<p>Essential Cookie dibutuhkan oleh Situs kami untuk mengerjakan dan memungkinkan Anda untuk bergerak mengelilinginya dan untuk menggunakan layanan dan fitur-fiturnya. Tanpa cookie yang sangat diperlukan ini, Situs tidak akan bekerja secara lancar untuk Anda sebagaimana yang kami inginkan dan kami dapat tidak bisa menyediakan Situs atau layanan atau fitur-fitur tertentu yang Anda minta.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h2>Penjelasan Session</h2>\r\n<p>Session cookie digunakan untuk memelihara keadaan aplikasi.</p>\r\n<p>Menerima/menolak melalui pengaturan browser</p>\r\n<p>&nbsp;</p>\r\n<h3>&nbsp;</h3>\r\n<h3>ID pengguna</h3>\r\n<p>Cookie ID pengguna digunakan untuk memastikan pengguna hanya melihat informasi mengenai diri mereka sendiri.</p>\r\n<p>Menerima/menolak melalui pengaturan browser</p>\r\n<p>&nbsp;</p>\r\n<h3>Keamanan Cookie</h3>\r\n<p>Cookie keamanan digunakan untuk pengendalian dan pemeriksaan keamanan.</p>\r\n<p>Menerima/menolak melalui pengaturan browser</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>COOKIE PELACAK PLUGIN SOSIAL</p>\r\n<p>&nbsp;</p>\r\n<p>Cookie tersebut digunakan untuk melacak anggota [dan non-anggota] atas jaringan media sosial untuk analisis riset pasar, dan pengembangan produk.</p>\r\n<p>&nbsp;</p>\r\n<p>Jenis cookie</p>\r\n<p>Penjelasan</p>\r\n<p>Bagaimana cara mengatur cookie</p>\r\n<p>Facebook</p>\r\n<p>Cookie digunakan untuk melacak anggota Facebook [dan non-anggota] untuk analisis riset pasar, dan pengembangan produk.</p>\r\n<p>Menerima/menolak melalui pengaturan browser</p>\r\n<p>Twitter</p>\r\n<p>Cookie tersebut digunakan untuk melacak anggota [dan non-anggota] untuk analisis riset pasar, dan pengembangan produk.</p>\r\n<p>Menerima/menolak melalui pengaturan browser</p>\r\n<p>&nbsp;</p>\r\n<p>COOKIE ANALITIK</p>\r\n<p>&nbsp;</p>\r\n<p>Cookie analitik dapat mengumpulkan informasi tentang penggunaan Anda atas Situs, dan memungkinkan kami untuk meningkatkan kinerja Situs kami. Sebagai contoh, cookie analitik memperlihatkan kami halaman mana yang paling sering dikunjungi pada Situs, membantu kami mencatat setiap kesulitan yang Anda alami dalam Situs, dan memperlihatkan kami bahwa iklan kami efektif atau tidak. Hal ini memungkinkan kami untuk melihat pola keseluruhan atas penggunaan Situs, selain daripada penggunaan oleh perorangan.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h2>Google analytics</h2>\r\n<p>Cookie Google analytics mengumpulkan keseluruhan data statistikal untuk meningkatkan presentasi dan navigasi Situs. Google menambahkan data keseluruhan dengan demografi dan kepentingan informasi, agar kami dapat lebih memahami pengunjung kami.</p>\r\n<p><a href=\"https://tools.google.com/dlpage/gaoptout\">https://tools.google.com/dlpage/gaoptout</a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3>PENGATURAN COOKIE</h3>\r\n<p>Walaupun sebagian besar browser internet pada awalnya diatur secara otomatis untuk menerima cookie, sebagian besar internet browser memungkinkan Anda untuk mengganti pengaturan untuk memblokir cookie atau memperingatkan Anda saat cookie dikirimkan ke perangkat Anda.</p>\r\n<p>&nbsp;</p>\r\n<p>Selain pilihan yang disediakan di atas, Anda dapat menolak, menerima atau menghapus cookie dari Situs setiap saat dengan mengaktifkan atau mengakses pengaturan pada browser Anda. Informasi tentang prosedur untuk mengaktifkan, menonaktifkan atau menghapus cookie dapat ditemukan di situs web penyedia browser internet Anda melalui layar bantu Anda.</p>\r\n<p>&nbsp;</p>\r\n<p>Perlu diketahui bahwa jika cookie dinonaktifkan atau dihapus, tidak semua fitur dari Situs dapat beroperasi sebagaimana mestinya. Sebagai contoh Anda mungkin tidak dapat mengunjungi area-area tertentu pada Situs kami atau Anda mungkin tidak menerima informasi pribadi Anda saat mengunjungi Situs.</p>\r\n<p>&nbsp;</p>\r\n<p>Jika Anda menggunakan perangkat yang berbeda untuk melihat dan mengakses Situs (misalnya komputer, smartphone, tablet dll) Anda akan perlu untuk memastikan bahwa setiap browser pada setiap perangkat disesuaikan dengan pilihan cookie Anda.</p>\r\n<p>&nbsp;</p>\r\n<p>Bila Anda ingin membersihkan semua cookie yang tertinggal pada situs web yang telah Anda kunjungi, berikut ini adalah link-link dimana Anda dapat mengunduh tiga program yang dapat membersihkan cookie pelacak:</p>\r\n<p>&nbsp;</p>\r\n<p>http://www.lavasoftusa.com/products/ad-aware_se_personal.php</p>\r\n<p>http://www.spybot.info/en/download/index.html</p>\r\n<p>http://www.webroot.com/consumer/products/spysweeper/</p>\r\n<p>&nbsp;</p>\r\n<h3>TAG PIXEL</h3>\r\n<p>Beberapa laman yang Anda kunjungi di Situs juga dapat mengumpulkan informasi melalui penggunaan tag pixel (disebut juga clear gifs) yang dapat dipergunakan bersama dengan pihak ketiga yang secara langsung mendukung kegiatan promosi dan pengembangan situs web. Sebagai contoh, situs web penggunaan informasi tentang pengunjung Situs kami dapat dibagikan dengan agen periklanan pihak ketiga untuk lebih mentargetkan iklan banner iklan internet pada situs web kami. Informasi yang dikumpulkan melalui penggunaan tag pixel bagaimanapun ini tidak, dapat diidentifikasikan secara pribadi, meskipun dapat dihubungkan pada informasi pribadi Anda.</p>\r\n<p>&nbsp;</p>\r\n<h2>HUBUNGI KAMI</h2>\r\n<p>Apabila Anda memiliki pertanyaan mengenai Kebijakan Cookie, mohon kontak kami di diundang dot com at&nbsp;gmail&nbsp;&nbsp;dot&nbsp;com.</p>\r\n<p>&nbsp;</p>\r\n<p>Perlu diketahui bahwa komunikasi melalui email tidaklah selalu aman; mohon agar tidak memasukan informasi kartu kredit atau informasi sensitif lainnya dalam email Anda kepada kami.</p>\r\n<p>&nbsp;</p>\r\n<h2>BANTUAN TERKAIT COOKIES</h2>\r\n<p>&nbsp;</p>\r\n<p>Browser - bantuan terkait Cookies:</p>\r\n<p>&nbsp;</p>\r\n<p>Internet Explorer &ndash; https://support.microsoft.com/en-GB/kb/278835</p>\r\n<p>Chrome &ndash; https://support.google.com/chrome/answer/95647?hl=en-GB</p>\r\n<p>Firefox &ndash; https://support.mozilla.org/en-GB/kb/delete-browsing-search-download-history-firefox</p>\r\n<p>Safari &ndash; https://support.apple.com/kb/PH5042?locale=en-GB</p>\r\n<p>Opera &ndash; http://www.opera.com/help/tutorials/</p>', 'Berikut ini adalah penjelasan dan ketentuan penggunaan Cookies diundang.com', '', 'media/blog/1/0/10458327_10202550612915044_6612668588764736060_n.jpg', 0, '2017-11-26 14:20:00', 'publish'),
(15, NULL, 'Tips &amp; Trik', 'test 2017', 'test-2017', '', '', '', '', '', '<h2 id=\"toc-prelude\"><a href=\"https://scotch.io/bar-talk/build-an-app-with-vuejs-and-django-part-one#toc-prelude\">Prelude</a></h2>\r\n<p>Sometime back I challenged myself to build a Django app and use VueJS for it&rsquo;s frontend. There are a lot of Laravel and VueJS tutorials out there and even within Scotch. Actually VueJS caught the attention of Taylor Otwell, the creator of Laravel, so much so that he personally endorses it. I however struggled to find a good resource on combining Django and VueJS. Here\'s a tutorial that would have been an answer to my questions back then. A testament of my learnings so far.</p>\r\n<h2 id=\"toc-introduction\"><a href=\"https://scotch.io/bar-talk/build-an-app-with-vuejs-and-django-part-one#toc-introduction\"><span class=\"icon is-large\">#</span>Introduction</a></h2>\r\n<p>This is your gateway to having the VueJS\'s sweetness in a Django app. Later articles will dig deeper as I cover routing and state management.</p>\r\n<div class=\"notification m-b-md\">Related Course:&nbsp;<a href=\"https://bit.ly/2gCILn1\">Build an Online Shop with Vue</a></div>\r\n<p>What this article will cover:</p>\r\n<ul>\r\n<li>Introduce you to VueJS</li>\r\n<li>Introduce you to Django</li>\r\n<li>Using Jinja templates for the view layer of your Django app</li>\r\n<li>Implement VueJS within the Jinja templates</li>\r\n</ul>\r\n<p>After each step, there is an link to the codebase as it should be after that step.</p>\r\n<h3>VueJS</h3>\r\n<p>It is said that&nbsp;<strong>simplicity is a prerequisite of reliability</strong>.&nbsp;<a href=\"http://evanyou.me/\">Evan You</a>&nbsp;must have been meditating on this saying when he thought of creating VueJS. During the past year it\'s become a favourite among developers. Compared to JS frameworks like Angular and React, many agree that VueJS\'s learning curve is the most gentle. This means it is easier to get the fundamentals rapidly. VueJS is backed by Laravel and JSFiddle and is at over 65,000 Github stars (as at the writing of this post).</p>\r\n<p>This&nbsp;<a href=\"https://jsfiddle.net/chrisvfritz/50wL7mdz/\">Hello World example</a>&nbsp;on JSFiddle is the best place to start. There are several resources that dig deeper to show you the building blocks of VueJS. The VueJS docs\' API and guide as well as these&nbsp;<a href=\"https://scotch.io/tag/vue-js\">tutorials</a>&nbsp;set you up on the road to success.</p>\r\n<h3>Django</h3>\r\n<p>Django is a Python framework that promises to be&nbsp;<em>the web framework for perfectionists with deadlines</em>. Django uses the MVC (Model, View, Controller) pattern dabbed MTV (Model, Template, View).</p>\r\n<p>To get started open the terminal (I&rsquo;m assuming that you have python and pip installed) then run&nbsp;<code>pip install django</code>. It is best that you do this in a virtual environment. Proceed with the following commands:</p>\r\n<pre class=\" language-bash\" data-title=\"bash\"><code class=\" language-bash\">django-admin startproject newapp\r\n<span class=\"token function\">cd</span> newapp\r\npython manage.py startapp journal</code></pre>\r\n<p>Doing this will give you the following folder structure:<img class=\"loading\" src=\"https://cdn.scotch.io/2617/w2q0FebBShqTv4xXqIwx_Screenshot%202017-04-23%2005.29.52.png\" alt=\"\" data-was-processed=\"true\" /></p>\r\n<p>To run the server simply run&nbsp;<code>python manage.py runserver</code>. Accessing&nbsp;<a href=\"http://localhost:8000/\">http://localhost:8000/</a>&nbsp;on your browser will give you such a page:<img class=\"loading\" src=\"https://cdn.scotch.io/2617/BZ4KlzetSPeyIbv6E1ug_Screenshot%202017-02-11%2021.44.57.png\" alt=\"\" data-was-processed=\"true\" />Don\'t mind the warning highlighted in red. They relate to the database which we are not concerned about for this tutorial.<img class=\"loading\" src=\"https://cdn.scotch.io/2617/COpgcn2ATeqvtitKIQOV_Screenshot%202017-04-23%2005.28.14.png\" alt=\"\" data-was-processed=\"true\" /></p>\r\n<blockquote>\r\n<p><a href=\"https://github.com/NdagiStanley/vuedjango/tree/Step-01\">Codebase up to this point</a></p>\r\n</blockquote>\r\n<h2 id=\"toc-jinja-templates-in-django\"><a href=\"https://scotch.io/bar-talk/build-an-app-with-vuejs-and-django-part-one#toc-jinja-templates-in-django\"><span class=\"icon is-large\">#</span>Jinja templates in Django</a></h2>\r\n<p>Quit the server with CONTROL-C and let\'s create our first view, shall we? Open the&nbsp;<code>views.py</code>&nbsp;file in the journal directory and these two lines.</p>\r\n<pre class=\" language-python\" data-title=\"python\"><code class=\" language-python\"><span class=\"token keyword\">def</span> <span class=\"token function\">index</span><span class=\"token punctuation\">(</span>request<span class=\"token punctuation\">)</span><span class=\"token punctuation\">:</span>\r\n    <span class=\"token keyword\">return</span> render<span class=\"token punctuation\">(</span>request<span class=\"token punctuation\">,</span> <span class=\"token string\">\'index.html\'</span><span class=\"token punctuation\">)</span></code></pre>\r\n<p>Create a&nbsp;<code>templates</code>&nbsp;folder in the same level as the&nbsp;<code>journal</code>&nbsp;folder and create a file:&nbsp;<code>index.html</code>&nbsp;in that folder. We\'ll start with a very simple index.html. Here\'s what I have:</p>\r\n<pre class=\" language-html\" data-title=\"html\"><code class=\" language-html\"><span class=\"token doctype\">&lt;!DOCTYPE html&gt;</span>\r\n\r\n<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>html</span><span class=\"token punctuation\">&gt;</span></span>\r\n<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>head</span><span class=\"token punctuation\">&gt;</span></span>\r\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>meta</span>&nbsp;<span class=\"token attr-name\">charset</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>UTF-8<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">&gt;</span></span>\r\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>meta</span>&nbsp;<span class=\"token attr-name\">name</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>viewport<span class=\"token punctuation\">\"</span></span>&nbsp;<span class=\"token attr-name\">content</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>width=device-width, initial-scale=1.0<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">&gt;</span></span>\r\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>meta</span>&nbsp;<span class=\"token attr-name\">http-equiv</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>X-UA-Compatible<span class=\"token punctuation\">\"</span></span>&nbsp;<span class=\"token attr-name\">content</span><span class=\"token attr-value\"><span class=\"token punctuation\">=</span><span class=\"token punctuation\">\"</span>ie=edge<span class=\"token punctuation\">\"</span></span><span class=\"token punctuation\">&gt;</span></span>\r\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>title</span><span class=\"token punctuation\">&gt;</span></span>Journal<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>title</span><span class=\"token punctuation\">&gt;</span></span>\r\n<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>head</span><span class=\"token punctuation\">&gt;</span></span>\r\n\r\n<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>body</span><span class=\"token punctuation\">&gt;</span></span>\r\n    <span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;</span>p</span><span class=\"token punctuation\">&gt;</span></span>Welcome to My Journal<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>p</span><span class=\"token punctuation\">&gt;</span></span>\r\n<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>body</span><span class=\"token punctuation\">&gt;</span></span>\r\n\r\n<span class=\"token tag\"><span class=\"token tag\"><span class=\"token punctuation\">&lt;/</span>html</span><span class=\"token punctuation\">&gt;</span></span></code></pre>\r\n<p>We then need to map this view to a url in order to call it. Simply put, we want to see this&nbsp;<code>index.html</code>&nbsp;when we get to a specific url on our browser. This is done by editing the&nbsp;<code>newapp/urls.py</code>. You\'ll notice that line 19 to 21 is a list called&nbsp;<strong>urlpatterns</strong>. Line 20 tells us that the url route&nbsp;<code>admin</code>&nbsp;is registered. This means that we have an admin dashboard ready for you out-of-the-box with Django. More about that later. If you are curious here is a&nbsp;<a href=\"https://docs.djangoproject.com/en/1.11/ref/contrib/admin/\">link</a>&nbsp;to the docs covering this. Since we want to display the index.html as the page served at&nbsp;<a href=\"http://localhost:8000/\">http://localhost:8000/</a>&nbsp;we\'ll import the index function within&nbsp;<code>journal/views.py</code>&nbsp;and map it to the url route&nbsp;<code>/</code>.</p>\r\n<p>We do this by adding two lines to the&nbsp;<code>newapp/urls.py</code>:</p>\r\n<p><code>from journal.views import index</code>&nbsp;above&nbsp;<strong>urlpatterns</strong>&nbsp;and</p>\r\n<p><code>url(r\'^$\', index, name=\'index\'),</code>&nbsp;within&nbsp;<strong>urlpatterns</strong>.</p>\r\n<p>Your urls.py will now look like this:</p>\r\n<pre class=\" language-python\" data-title=\"python\"><code class=\" language-python\"><span class=\"token keyword\">from</span> django<span class=\"token punctuation\">.</span>conf<span class=\"token punctuation\">.</span>urls <span class=\"token keyword\">import</span> url\r\n<span class=\"token keyword\">from</span> django<span class=\"token punctuation\">.</span>contrib <span class=\"token keyword\">import</span> admin\r\n<span class=\"token keyword\">from</span> journal<span class=\"token punctuation\">.</span>views <span class=\"token keyword\">import</span> index\r\n\r\nurlpatterns <span class=\"token operator\">=</span> <span class=\"token punctuation\">[</span>\r\n    url<span class=\"token punctuation\">(</span>r<span class=\"token string\">\'^admin/\'</span><span class=\"token punctuation\">,</span> admin<span class=\"token punctuation\">.</span>site<span class=\"token punctuation\">.</span>urls<span class=\"token punctuation\">)</span><span class=\"token punctuation\">,</span>\r\n    url<span class=\"token punctuation\">(</span>r<span class=\"token string\">\'^$\'</span><span class=\"token punctuation\">,</span> index<span class=\"token punctuation\">,</span> name<span class=\"token operator\">=</span><span class=\"token string\">\'index\'</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">,</span>\r\n<span class=\"token punctuation\">]</span></code></pre>\r\n<p>Lastly, our view needs to know where the template index is located. Open the&nbsp;<code>settings.py</code>&nbsp;within newapp and search for&nbsp;<code>TEMPLATES</code>. Within it, you\'ll notice a key in the object called&nbsp;<code>\'DIRS\'</code>&nbsp;whose value is an empty list. Enter&nbsp;<code>os.path.join(BASE_DIR, \"templates\"),</code>&nbsp;so that that line reads:</p>\r\n<pre class=\" language-python\" data-title=\"python\"><code class=\" language-python\">        <span class=\"token string\">\'DIRS\'</span><span class=\"token punctuation\">:</span> <span class=\"token punctuation\">[</span>os<span class=\"token punctuation\">.</span>path<span class=\"token punctuation\">.</span>join<span class=\"token punctuation\">(</span>BASE_DIR<span class=\"token punctuation\">,</span> <span class=\"token string\">\"templates\"</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">,</span><span class=\"token punctuation\">]</span></code></pre>\r\n<p>That\'s about it. Back to the terminal run&nbsp;<code>python manage.py runserver</code>&nbsp;access&nbsp;<a href=\"http://localhost:8000/\">http://localhost:8000/</a>&nbsp;on your browser and voila your page is displayed.<img class=\"loading\" src=\"https://cdn.scotch.io/2617/0hgsugLXRouVAGO1UGQJ_Screenshot%202017-04-23%2009.39.17.png\" alt=\"\" data-was-processed=\"true\" /></p>\r\n<p>That was easy, right? We just added 4 lines of code, edited one line in the&nbsp;<code>settings.py</code>&nbsp;and added one file the&nbsp;<code>index.html</code>.</p>\r\n<p>This section is entitled&nbsp;<strong><code>Jinja templates in Django</code></strong>&nbsp;so let\'s see what that means. Jinja2 is a full featured template engine for Python which is both beautiful and powerful. I plan to tackle&nbsp;<code>template inheritance</code>&nbsp;and&nbsp;<code>context handling</code>&nbsp;for now.</p>\r\n<p>This is a journal and for the sake of simplicity in this tutorial, we\'ll display a list of three days (titles with the words: Day 1, Day 2 and Day 3). To do this edit&nbsp;<code>views.py</code>&nbsp;file to include:</p>\r\n<pre class=\" language-python\" data-title=\"python\"><code class=\" language-python\">context <span class=\"token operator\">=</span> <span class=\"token punctuation\">{</span>\r\n        <span class=\"token string\">\'days\'</span><span class=\"token punctuation\">:</span> <span class=\"token punctuation\">[</span><span class=\"token number\">1</span><span class=\"token punctuation\">,</span> <span class=\"token number\">2</span><span class=\"token punctuation\">,</span> <span class=\"token number\">3</span><span class=\"token punctuation\">]</span><span class=\"token punctuation\">,</span>\r\n    <span class=\"token punctuation\">}</span></code></pre>\r\n<p>just before the&nbsp;<strong>return</strong>&nbsp;statement. Make sure your indentation is right. Change&nbsp;<code>index.html</code>&nbsp;to&nbsp;<code>days.html</code>&nbsp;then add&nbsp;<code>context</code>as an additional argument in the&nbsp;<code>render</code>&nbsp;method. The file should look like this eventually:</p>\r\n<pre class=\" language-python\" data-title=\"python\"><code class=\" language-python\"><span class=\"token keyword\">from</span> django<span class=\"token punctuation\">.</span>shortcuts <span class=\"token keyword\">import</span> render\r\n\r\n<span class=\"token comment\"># Create your views here.</span>\r\n\r\n<span class=\"token keyword\">def</span> <span class=\"token function\">index</span><span class=\"token punctuation\">(</span>request<span class=\"token punctuation\">)</span><span class=\"token punctuation\">:</span>\r\n    context <span class=\"token operator\">=</span> <span class=\"token punctuation\">{</span>\r\n        <span class=\"token string\">\'days\'</span><span class=\"token punctuation\">:</span> <span class=\"token punctuation\">[</span><span class=\"token number\">1</span><span class=\"token punctuation\">,</span> <span class=\"token number\">2</span><span class=\"token punctuation\">,</span> <span class=\"token number\">3</span><span class=\"token punctuation\">]</span><span class=\"token punctuation\">,</span>\r\n    <span class=\"token punctuation\">}</span>\r\n    <span class=\"token keyword\">return</span> render<span class=\"token punctuation\">(</span>request<span class=\"token punctuation\">,</span> <span class=\"token string\">\'days.html\'</span><span class=\"token punctuation\">,</span> context<span class=\"token punctuation\">)</span></code></pre>\r\n<p>In the spirit of modularity, I\'ll split index.html into&nbsp;<code>masterpage.html</code>&nbsp;and&nbsp;<code>days.html</code>.</p>\r\n<p>Copy the lines above the HTML paragraph tag -&nbsp;<code>p</code>&nbsp;and paste into a new file&nbsp;<code>masterpage.html</code>&nbsp;in the templates folder. We\'ll add a Jinja2 block in the next line:&nbsp;<code>{% block content %} {% endblock %}</code>&nbsp;and finally add HTML&nbsp;<code>&lt;/body&gt;</code>&nbsp;and&nbsp;<code>&lt;/html&gt;</code>closing tags. The file will look like this:</p>', 'test 2017', '', 'media/blog/s/e/sepatu-eiger-w132.jpg', 0, '2017-11-26 14:18:10', 'publish'),
