(20, 1, 'Uncategorized', 'Wololo', 'wololo', 'Wololo', 'Wololo', 'Wololo', '', '', '<h1>Hindari 3 Makanan Ini Saat Sarapan</h1>\r\n\r\n<p>Bagi banyak orang, sarapan merupakan rutinitas yang tidak boleh terlewatkan. Asupan gizi dan nutrisi saat sarapan sangat membantu metabolisme tubuh untuk seharian penuh. Banyak pakar kesehatan yang mengatakan, sarapan bisa membuat berat badan yang ideal.</p>\r\n\r\n<p>Menurut para ahli kesehatan, sarapan yang baik terdiri dari karbohidrat, lauk pauk, sayuran dan buah-buahan, tentunya dalam porsi sedikit. Namun bila semua itu terasa sulit, kamu bisa sarapan dengan mengonsumsi sepotong roti berisi selai cokelat atau kacang serta secangkir teh lemon hangat.</p>\r\n\r\n<p>Tapi siapa sangka ternyata, ada beberapa menu yang sebaiknya tidak dikonsumsi saat sarapan. Kira-kira apa saja ya?</p>\r\n\r\n<p><em>Jus Buah</em></p>\r\n\r\n<p><em><img alt=\"KK Tip: Have at least 1000mg of Vitamin C a day. It helps keep your immune system strong, and even helps to keep your skin from wrinkling.\" src=\"https://i.pinimg.com/564x/49/b9/ac/49b9ac7cbc73382e32d8bd785d3b8c20.jpg\" /></em></p>\r\n\r\n<p>Segelas jus buah memang terasa menyegarkan. Apalagi bila kamu memilih buah-buahan yang mengandung banyak serat seperti pepaya, alpukat, melon, apel dan lainya yang justru memberikan efek mengenyangkan. Sarapan jus buah tanpa menu pendamping lainnya ternyata memiliki risiko kenaikan berat badan lebih tinggi. Kenapa? olahan jus buah biasanya ditambahkan gula untuk memperkuat rasa manisnya. Selain itu, jus buah juga tidak bisa membuat tubuh menahan lapar hingga jam makan siang tiba. Akibatnya kamu memiliki kesempatan untuk ngemil sebelum jam makan siang.</p>\r\n\r\n<p><em>Daging Olahan</em></p>\r\n\r\n<p><em><img alt=\"Order From The Kids Menu If You Want A New Last Name\" src=\"https://i.pinimg.com/564x/b4/98/c3/b498c399ef0491132f1cdad41ee84f13.jpg\" /></em></p>\r\n\r\n<p>Makanan yang satu ini memang sangat mudah untuk diolah dalam berbagai menu utama maupun pendamping, misalnya saja&nbsp;<em>sandwich</em>, mie, dan sop. Namun sayang, sosis, daging asap dan nugget justru mengandung bahan-bahan minim vitamin akibat proses pembuatannya. Menu daging olahan ini juga tidak disarankan untuk dikonsumsi saat sarapan, karena mampu meningkatkan obesitas, gangguan jantung, dan hipertensi.</p>\r\n\r\n<p><em>Sereal</em></p>\r\n\r\n<p><em><img alt=\"Fruit loops, i miss you and Mickey Mouse some days, it was so simple.\" src=\"https://i.pinimg.com/564x/d4/9f/cc/d49fccbd74674ed245ad6964be69738a.jpg\" /></em></p>\r\n\r\n<p>Sereal kerap dianggap sebagai menu sarapan yang cepat dan simpel. Kandungan serat alami pada sereal mampu memenuhi kebutuhan vitamin pada tubuh. Namun, penambahan susu kental manis pada penyajian seharusnya dihindari karena bisa memberikan rasa manis yang berlebih sehingga berdampak buruk bagi kesehatan.</p>\r\n\r\n<p>Itulah deretan menu sarapan yang sebaiknya tidak kamu konsumsi. Selain makanan di atas untuk kamu yang sering merasakan kantuk yang berat saat bekerja, mungkin kamu juga perlu menghindari sarapan dengan karbohidrat berlebih apalagi nasi santan lengkap dengan gorengan. Pilihlah menu sarapan yang bisa memberikan keuntungan bagi tubuh dan mampu menjaga&nbsp;<em>mood&nbsp;</em>kamu baik sepanjang hari.</p>\r\n', '', '', 'media/upload/2018/08/uchujin.jpg', 0, '2018-08-15 16:50:14', 'publish');
